INSERT INTO `article` VALUES (1, '联系我们', 'Contact us', '2018-04-23 07:47:24', '2018-08-28 00:39:28', 0, '<p></p><p></p><p></p><p></p><p></p><p>12Buy.com<br></p><div><div>&nbsp;</div><div>“简单生活，百般滋味”！2017年，12Buy.com创立于美国洛杉矶，我们一直致力于为用户寻找亚洲各国的名食小吃，满足您对各种美味零食的需求。让每位用户在海外都能体验到“在家乡一样的味道”，因此与其它平台不同，我们的零食多为各国当地的特色零食及名吃小吃。这些精心挑选的零食大多彰显着它们独特的品味和文化，我们希望12Buy.com里的每个老饕都能感受到家一样的温馨。&nbsp;</div><div>&nbsp;</div><div>传统工艺制作，做工考究，精致！</div><div>&nbsp;</div><div>多款零食，多种口味，丰富的让你永远吃不够！满足更多味蕾需求，让好货拒绝雷同！</div></div><p></p><p><br></p>', '<p></p><p></p><p></p><p></p><p></p><p><br></p><p></p><p><br></p><p></p><p><br></p><p></p><p><br></p><p></p><p><br></p>');
