INSERT INTO `article` VALUES (6, '关于我们', 'About us', '2018-04-23 07:47:24', '2018-07-11 05:50:57', 2, '<p><div><br></div><div><div>&nbsp;</div><div>“简单生活，百般滋味”！2017年，12Buy.com创立于美国洛杉矶，我们一直致力于为用户寻找亚洲各国的名食小吃，满足您对各种美味零食的需求。让每位用户在海外都能体验到“在家乡一样的味道”，因此与其它平台不同，我们的零食多为各国当地的特色零食及名吃小吃。这些精心挑选的零食大多彰显着它们独特的品味和文化，我们希望12Buy.com里的每个老饕都能感受到家一样的温馨。&nbsp;</div><div>&nbsp;</div><div>传统工艺制作，做工考究，精致！</div><div>&nbsp;</div><div>多款零食，多种口味，丰富的让你永远吃不够！满足更多味蕾需求，让好货拒绝雷同！</div></div><p></p></p>', '<p><p></p></p>');
INSERT INTO `article` VALUES (7, '隐私政策', 'Privacy policy', '2018-04-23 07:47:24', '2018-09-01 06:01:28', 3, '<div>Credit Card Privacy Policy<br></div><div><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Our Commitment to You</strong>&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\">We respect and are committed to protecting your privacy. We do not sell or pass along your personal information to anyone. Name, address and other identifying information that you provide is used by the 12Buy.com to maintain complete and accurate contact information, refund or cancellation, and order records. Your credit card information is not retained as the result of any of these processes. &nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Collection of Information</strong>&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\">12Buy.com will collect and use information obtained from credit card transactions only for business purposes. These business purposes include the payment of purchasing products.&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Protecting Your Credit Card Information</strong></p><p align=\"left\">&nbsp;</p><p align=\"left\">&nbsp; The credit card information provided by you to 12Buy.com will be stored in a confidential manner. Our employees may access such information only when there is an appropriate business reason to do so, such as when a refund must be issued back to the credit card. We maintain physical, electronic and procedural safeguards to protect your information, and our employees are required to follow these privacy standards.&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Disclosure of Your Information</strong>&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\">12Buy.com does not disclose any nonpublic information (such as credit card number and their expiration dates) about our customers or former customers to anyone, except as required by law. We disclose information only when it is necessary for the conduct of State or Federal government business, or under circumstances where disclosure is required by law. Information may also be disclosed for audit purposes, to regulatory agencies or for other general administrative services. We do not disclose information about you to other entities who may want to sell their products to you.&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Transaction Security</strong>&nbsp;</p><p align=\"left\">​</p><p align=\"left\">12Buy.com\'s website uses Secure Socket Layer (SSL) protocol to ensure transaction security.</p></div><p></p>', '<div>隐私政策</div><div><p align=\"left\">Credit Card Privacy Policy</p><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Our Commitment to You</strong>&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\">We respect and are committed to protecting your privacy. We do not sell or pass along your personal information to anyone. Name, address and other identifying information that you provide is used by the 12Buy.com to maintain complete and accurate contact information, refund or cancellation, and order records. Your credit card information is not retained as the result of any of these processes. &nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Collection of Information</strong>&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\">12Buy.com will collect and use information obtained from credit card transactions only for business purposes. These business purposes include the payment of purchasing products.&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Protecting Your Credit Card Information</strong></p><p align=\"left\">&nbsp;</p><p align=\"left\">&nbsp; The credit card information provided by you to 12Buy.com will be stored in a confidential manner. Our employees may access such information only when there is an appropriate business reason to do so, such as when a refund must be issued back to the credit card. We maintain physical, electronic and procedural safeguards to protect your information, and our employees are required to follow these privacy standards.&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Disclosure of Your Information</strong>&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\">12Buy.com does not disclose any nonpublic information (such as credit card number and their expiration dates) about our customers or former customers to anyone, except as required by law. We disclose information only when it is necessary for the conduct of State or Federal government business, or under circumstances where disclosure is required by law. Information may also be disclosed for audit purposes, to regulatory agencies or for other general administrative services. We do not disclose information about you to other entities who may want to sell their products to you.&nbsp;</p><p align=\"left\">&nbsp;</p><p align=\"left\"><strong>Transaction Security</strong>&nbsp;</p><p align=\"left\">​</p><p align=\"left\">12Buy.com\'s website uses Secure Socket Layer (SSL) protocol to ensure transaction security.</p></div><p></p>');
INSERT INTO `article` VALUES (8, '使用条款', 'Terms of use', '2018-04-23 07:47:24', '2018-09-01 06:02:02', 3, '<div><strong>TERMS OF USE</strong><br></div><div><div><p>&nbsp;</p><p align=\"left\">12Buy.com reserves the right, at its sole discretion, to change, modify, add or remove portions of these Terms of Use, at any time. It is your responsibility to check these Terms of Use periodically for changes. Your continued use of the site following the posting of changes will mean that you accept and agree to the changes. As you comply with these Terms of Use, 12Buy.com grants you a personal, non-exclusive, non-transferable limited privilege to enter and use the site.&nbsp; Please read the following terms and conditions of use carefully before using the website.&nbsp; All users of this site agree that access to and use of this site are subject to the following terms and conditions and other applicable law. If you do not agree to these terms and conditions, please do not use this site.</p><p>&nbsp;</p><p><strong>Copyright</strong></p><p>&nbsp;</p><p align=\"left\">The entire content included in this site, including but not limited to text, graphics or code is copyrighted as a collective work under the United States and other copyright laws, and is the property of 12Buy.com.&nbsp; The collective work includes works that are licensed to 12Buy.com.&nbsp; Copyright 2017, 12Buy.com ALL RIGHTS RESERVED. Permission is granted to electronically copy and print hard copy portions of this site for the sole purpose of placing an order with 12Buy.com or purchasing 12Buy.com products. You may display and, subject to any expressly stated restrictions or limitations relating to specific material, download or print portions of the material from the different areas of the site solely for your own non-commercial use, or to place an order with 12Buy.com or to purchase 12Buy.com products. Any other use, including but not limited to the reproduction, distribution, display or transmission of the content of this site is strictly prohibited, unless authorized by 12Buy.com. You further agree not to change or delete any proprietary notices from materials downloaded from the site.</p><p align=\"left\">&nbsp;</p><p><strong>Trademarks</strong></p><p>&nbsp;</p><p align=\"left\">All trademarks, service marks and trade names of 12Buy.com used in the site are trademarks or registered trademarks of 12Buy.com.</p><p>&nbsp;</p><p><strong>Warranty Disclaimer</strong></p><p>&nbsp;</p><p align=\"left\">This site and the materials and products on this site are provided “as is” and without warranties of any kind, whether express or implied. To the fully extent permissible pursuant to applicable law, 12Buy.com disclaims all warranties, express or implied, including, but not limited to, implied warranties of merchantability and fitness for a particular purpose and non-infringement. 12Buy.com does not represent or warrant that the functions contained in the site will be uninterrupted or error-free, that the defects will be corrected, or that this site or the server that makes the site available are free of viruses or other harmful components. 12Buy.com does not make any warrantees or representations regarding the use of the materials in this site in terms of their correctness, accuracy, adequacy, usefulness, timeliness, reliability or otherwise. Some states do not permit limitations or exclusions on warranties, so the above limitations may not apply to you.</p><p>&nbsp;</p><p><strong>Limitation of Liability</strong></p><p>&nbsp;</p><p align=\"left\">12Buy.com shall not be liable for any special or consequential damages that result from the use of, or the inability to use, the materials on the site or the performance of the products even if 12Buy.com has been advised of the possibility of such damages. Applicable law may not allow the limitation of exclusion of liability or incidental or consequential damages, so the above limitation or exclusion may not apply to you.</p><p>&nbsp;</p><p><strong>Typographical Errors</strong></p><p>&nbsp;</p><p align=\"left\">Due to product improvements design, specifications are subject to change without notice. While we work to ensure that product information on our website is correct, actual product packaging and materials may contain more and different information to that displayed on our website. All information about the products on our website is provided for information purposes only. We recommend that you do not rely solely on the information presented on our website. Please always read labels, warnings and directions provided with the product before use. Prices are subjected to change without notice. We do our best to make sure that all information on this site is accurate. Despite our best efforts, sometimes an item may be priced incorrectly. In the event a product is listed at an incorrect price due to typographical, photographic, or technical error or error in pricing information received from our suppliers, 12Buy.com reserves the right to cancel any orders placed for product listed at the incorrect price.&nbsp; If an item’s correct price is lower than our stated price, we will charge the lower amount and ship you the item.&nbsp; If an item’s correct price is higher than our stated price, we will cancel your order and notify you of the price error and order cancellation. You will, of course, have an opportunity to purchase the item at the correct price, if you so wish.</p><p>&nbsp;</p><p><strong>Termination</strong></p><p>&nbsp;</p><p align=\"left\">These terms and conditions are applicable to you upon your accessing the site and/or completing the registration or shopping process. These terms and conditions, or any part of them, may be terminated by 12Buy.com without notice at any time, for any reason. The provisions relating to Copyrights, Trademark, Disclaimer, Limitation of Liability, indemnification and miscellaneous, shall survive any termination.</p><p>&nbsp;</p><p><strong>Notice</strong></p><p>&nbsp;</p><p align=\"left\">12Buy.com may deliver notice to you by means of e-mail, a general notice on the site, or by other reliable method to the address you have provided to 12Buy.com.</p><p>&nbsp;</p><p><strong>Miscellaneous</strong></p><p>&nbsp;</p><p align=\"left\">Your use of this site shall be governed in all respects by the laws of the state of California, U.S.A., without regard to choose of law provisions, and not by the 1980 U.N. Convention on contracts for the international sale of goods. You agree that jurisdiction over and venue in any legal proceeding directly or indirectly arising out of or relating to this site (including but not limited to the purchase of 12Buy.com products) shall be in the state or federal courts located in Washington County, Oregon. Any cause of action or claim you may have to respect to the site (including but not limited to the purchase of 12Buy.com products) must be commenced within one (1) year after the claim or cause of action arises. 12Buy.com’s failure to insist upon or enforce strict performance of any provision of these terms and conditions shall not be construed as a waiver of any provision or right. Neither the course of conduct between the parties nor trade practice shall act to modify any of these terms and conditions. 12Buy.com may assign its rights and duties under this Agreement to any part at any time without notice to you.</p><p>&nbsp;</p><p><strong>Use of Site</strong></p><p>&nbsp;</p><p align=\"left\">Harassment in any manner or form on the site, including via e-mail, chat, or by use of obscene or abusive language, is strictly forbidden. Impersonation of others, including a 12Buy.com or other licensed employee, host, or representative, as well as other members or visitors on the site is prohibited. You may not upload to, distribute, or otherwise publish through the site any content which is libelous, defamatory, obscene, threatening, invasive of privacy or publicity rights, abusive, illegal, or otherwise objectionable which may constitute or encourage a criminal offense, violate the rights of any party or which may otherwise give rise to liability or violate any law. You may not upload commercial content on the site or use the site to solicit others to join or become members of any other commercial online service or other organization.</p><p>&nbsp;</p><p><strong>Participation Disclaimer</strong></p><p>&nbsp;</p><p align=\"left\">12Buy.com does not and cannot review all communications and materials posted to or created by users accessing the site, and is not in any manner responsible for the content of these communications and materials. You acknowledge that by providing you with the ability to view and distribute user-generated content on the site, 12Buy.com is merely acting as a passive conduit for distribution and is not undertaking any obligation or liability relating to any contents or activities on the site. However, 12Buy.com reserves the right to block or remove communications or materials that it determines to be (a) abusive, defamatory, or obscene, (b) fraudulent, deceptive, or misleading, (c) in violation of a copyright, trademark or, other intellectual property right of another or (d) offensive or otherwise unacceptable to 12Buy.com in its sole discretion.</p><p>&nbsp;</p><p><strong>Indemnification</strong></p><p>&nbsp;</p><p align=\"left\">You agree to indemnify, defend, and hold harmless 12Buy.com, its officers, directors, employees, agents, licensors and suppliers (collectively the “Service Providers”) from and against all losses, expenses, damages and costs, including reasonable attorneys’ fees, resulting from any violation of these terms and conditions or any activity related to your account (including negligent or wrongful conduct) by you or any other person accessing the site using your Internet account.&nbsp; * The following items are not applicable to unconditional return policy: Perishable goods – to ensure food safety, food hygiene and integrity, food products with no quality issues, cannot be returned. For packaging damage, leakage, deterioration and other issues, please contact our customer service team and we would be happy to assist you.</p></div><div>&nbsp;</div></div><p><p></p></p>', '<p><p></p></p>');
INSERT INTO `article` VALUES (9, '常见问题', 'FAQ', '2018-04-23 07:47:24', '2018-09-01 05:59:23', 4, '<div>常见问题</div><div><div background:=\"\" float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" text-indent:=\"\" width:=\"\"><b>关于订单</b></div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>能打电话下订单吗?</b>&nbsp;很抱歉，目前暂时无法通过电话下单。&nbsp;<b>12Buy.com 网接受什么支付方式?</b>&nbsp;Visa，MasterCard，Discover，American Express，PayPal，储蓄卡&nbsp;<b>为什么付款成功后，账户没有显示应有积分?</b>&nbsp;积分将会在包裹寄出后自动添加在您的12Buy.com账户&nbsp;<b>我能更改或者取消订单吗?</b>&nbsp;一旦您的订单被确认，将无法进行修改，但我们可以为您取消未发货订单.&nbsp;<b>商品卖完了会补货吗?</b>&nbsp;大部分商品都会在两周内补货，其余缺货较长时间的商品，请与客服联系查看预计的补货时间。销售税：销售税将会添加到您所购买的商品。 &nbsp;</div><div background:=\"\" float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" text-indent:=\"\" width:=\"\"><b>订单处理</b></div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\">订单派送工作日为周一 至周五（节假日除外）。我们需要1到2个工作日处理并发送您的订单，在订单高峰期，我们可能需要额外的5个工作日处理您的订单。&nbsp; 本站将会通过第三方把产品送到您所指定的送货地址。所有在本站上列出的送货时间为参考时间,参考时间的计算是根据库存状况、正常的处理过程和送货时间、送货地点的基础上估计得出的。 请清楚准确地填写您的真实姓名、送货地址及联系方式。 因如下情况造成订单延迟或无法配送等,本站将无法承担迟延配送的责任： 1.如果您订单的产品缺货时，可能会延误您的订单发送。 2.客户提供错误信息和不详细的地址。 3.货物送达无人签收，由此造成的重复配送所产生的费用及相关的后果。 4.不可抗力，例如：自然灾害、交通戒严、突发战争等。</div><div background:=\"\" float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" text-indent:=\"\" width:=\"\"><b>订单状态</b></div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>如何查看订单状态？</b>&nbsp; 最简便快捷的方式是登陆您的账户，查看订单状态。通过我们给您发送的邮件查看订单状态，我们会在您订单确认和订单发货后给该订单所属的联系邮件发送确认通知，请查阅收件箱和垃圾邮箱，建议把我们的邮件添加进联系人名单，以便日后收到相关通知。通过联系客服了解订单情况</div><div background:=\"\" float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" text-indent:=\"\" width:=\"\"><b>关于邮寄</b></div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>我们使用什么配送方式?</b>&nbsp; 您的订单将会根据包裹的重量使用USPS或UPS负责邮寄.详情请查看配送说明</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>12Buy.com可以邮寄到美国境外吗?</b>&nbsp; 抱歉，目前邮寄范围仅限美国境内.</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>如何追踪包裹?</b>&nbsp; 订单发货后，您会收到一封含有包裹追踪号的发货确认通知，您可以点击该追踪号或登录相关邮件公司网页查看您的包裹运输情况. 发货后包裹追踪信息需要2个工作日更新</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>我能更改地址吗?</b>&nbsp; 发货前，我们可以免费为您修改收件信息，一旦包裹转交给邮寄公司，邮件公司将会收取$12.00-$15.00作为修改费，详细操作请您发邮件联系客服.</div><div background:=\"\" float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" text-indent:=\"\" width:=\"\"><b>配送资费</b></div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>美国48个州：</b>&nbsp; 1. Ground Shipping $5.99，最终价满$39包邮。 2. UPS 2 Day Air $39.99 （限重20磅以下）</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>阿拉斯加/夏威夷：</b>&nbsp; USPS ALASKA/HAWAII $29.99 （限重20磅以下） 由于地址填写错误,送货公司无法联系收货人,收货人拒绝收取包裹,我们将收到退回包裹后进行退款处理,被退回包裹将不能被重新邮寄,如果顾客希望重新邮寄,需要在12Buy.com网下新的订单。</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>特别说明：</b>&nbsp; 1.在订单发货前修改地址,12Buy.com网将不会收取费用帮您修改地址。 2.在订单派送过程中更改收货地址，12Buy.com可以帮助顾客修改地址,可是UPS或者USPS将会收取顾客$12-$15的修改费用。 3.所用订单邮寄重量最高的配额为30磅，订单超过30磅我们有权取消订单或收取额外邮寄费用。 4.非常抱歉我们无法向P.O. box 和 A.P.O. box 地址发货,所有填写不正确地址的订单将被自动取消或被退件。</div><div background:=\"\" float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" text-indent:=\"\" width:=\"\"><b>核实配送／追踪订单</b></div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>核实配送：</b>&nbsp; 请在确认订单时务必核实您的订单资料– 名字，收货地址（邮编，城市，国家），账单地址等。如果您的订单信息有误，将耽误您的订单进度。希望您及时与我们客服联系。&nbsp;&nbsp;<b>追踪订单：</b>请登录您的12Buy.com账户，查询订单状态。</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>退换说明</b>&nbsp;如果您的订单中有产品缺货，我们可能会暂时取消您的订单，或取消订单中缺货的产品。客服人员将发送提示邮件并退还差价。</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>商品问题</b>&nbsp; 如商品破损、错发、漏发或超过保质期等，请在收到包裹的30天内（逾期不予受理，请见谅），把商品受损、过了保质期、错发、漏发商品的清晰照片和您包裹内的整张订单信息的清晰照片发到客服邮箱help@12buy.com, 货源充足的情况下，可按要求补发，否则将会以退还积分或退款处理。</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>生鲜类商品</b>&nbsp; 为保证食品安全和新鲜，12Buy.com使用1-Day Air派送生鲜类商品，配送地址必须有人签收。如发生错发、漏发、包裹破损，例如 “胀袋”、”空蟹”、因邮局产生的收货延迟等问题，请于收到发货通知的3天内联系客服，我们将及时为您处理。 胀袋需在2天内通知，空蟹任何时间都可赔付。货源充足的情况下，可要求补发，也可退款。 以下情况不予退换，敬请谅解： ■ 未及时签收 ■ 收货后未冷冻 ■ 未及时投诉 ■ 无有效证明</div><div background:=\"\" float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" text-indent:=\"\" width:=\"\"><b>退货流程</b></div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>商品问题</b>&nbsp; 请在退货前先将退货申请发至我们的客服邮箱help@12buy.com。如果退货申请是由于商品受损、过了保质期、错发等情况，请将您包裹内的整张订单信息和相关商品的清晰照片发给我们。 退货产生的费用将会根据实际情况由亚米或者顾客承担。如果在退货申请批准后的15个工作日内没有将商品寄回，退货申请将会被取消。</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>退款处理时间</b>&nbsp; 我们在收到退货包裹后，将会通过邮件通知您并办理退款。如果当时使用了积分付款，退款时先退积分，其余退款需要5-7个工作日显示在您当时付款的银行/PayPal账户上。对于声明未开封的商品退货，客服将在收到退回包裹后进行核查，一旦确认完好无损将办理退款。</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>12Buy.com网的退换声明是什么？</b>&nbsp; 12Buy.com销售的商品均有正品保证，但是如果您收到商品后觉得不满意，请详细阅读退换声明并联系客服人员。</div><div float:=\"\" font-size:=\"\" line-height:=\"\" margin-top:=\"\" microsoft=\"\" width:=\"\"><b>我多久可以收到退款?</b>&nbsp; 7-10个工作日</div></div><p><p></p></p>', '<p><p></p></p>');
