been \nadvised of the possibility of such damages. Applicable law may not allow\n the limitation of exclusion of liability or incidental or consequential\n damages, so the above limitation or exclusion may not apply to you.</p><p>&nbsp;</p><p align=\"center\"><strong>Typographical Errors</strong></p><p>&nbsp;</p><p align=\"left\">Due\n to product improvements design, specifications are subject to change \nwithout notice. While we work to ensure that product information on our \nwebsite is correct, actual product packaging and materials may contain \nmore and different information to that displayed on our website. All \ninformation about the products on our website is provided for \ninformation purposes only. We recommend that you do not rely solely on \nthe information presented on our website. Please always read labels, \nwarnings and directions provided with the product before use. Prices are\n subjected to change without notice. We do our best to make sure that \nall information on this site is accurate. Despite our best efforts, \nsometimes an item may be priced incorrectly. In the event a product is \nlisted at an incorrect price due to typographical, photographic, or \ntechnical error or error in pricing information received from our \nsuppliers, 12Buy.com reserves the right to cancel any orders placed for \nproduct listed at the incorrect price.&nbsp; If an item’s correct price is \nlower than our stated price, we will charge the lower amount and ship \nyou the item.&nbsp; If an item’s correct price is higher than our stated \nprice, we will cancel your order and notify you of the price error and \norder cancellation. You will, of course, have an opportunity to purchase\n the item at the correct price, if you so wish.</p><p>&nbsp;</p><p align=\"center\"><strong>Termination</strong></p><p>&nbsp;</p><p align=\"left\">These\n terms and conditions are applicable to you upon your accessing the site\n and/or completing the registration or shopping process. These terms and\n conditions, or any part of them, may be terminated by 12Buy.com without\n notice at any time, for any reason. The provisions relating to \nCopyrights, Trademark, Disclaimer, Limitation of Liability, \nindemnification and miscellaneous, shall survive any termination.</p><p>&nbsp;</p><p align=\"center\"><strong>Notice</strong></p><p>&nbsp;</p><p align=\"left\">12Buy.com\n may deliver notice to you by means of e-mail, a general notice on the \nsite, or by other reliable method to the address you have provided to \n12Buy.com.</p><p>&nbsp;</p><p align=\"center\"><strong>Miscellaneous</strong></p><p>&nbsp;</p><p align=\"left\">Your\n use of this site shall be governed in all respects by the laws of the \nstate of California, U.S.A., without regard to choose of law provisions,\n and not by the 1980 U.N. Convention on contracts for the international \nsale of goods. You agree that jurisdiction over and venue in any legal \nproceeding directly or indirectly arising out of or relating to this \nsite (including but not limited to the purchase of 12Buy.com products) \nshall be in the state or federal courts located in Washington County, \nOregon. Any cause of action or claim you may have to respect to the site\n (including but not limited to the purchase of 12Buy.com products) must \nbe commenced within one (1) year after the claim or cause of action \narises. 12Buy.com’s failure to insist upon or enforce strict performance\n of any provision of these terms and conditions shall not be construed \nas a waiver of any provision or right. Neither the course of conduct \nbetween the parties nor trade practice shall act to modify any of these \nterms and conditions. 12Buy.com may assign its rights and duties under \nthis Agreement to any part at any time without notice to you.</p><p>&nbsp;</p><p align=\"center\"><strong>Use of Site</strong></p><p>&nbsp;</p><p align=\"left\">Harassment\n in any manner or form on the site, including via e-mail, chat, or by \nuse of obscene or