rs (collectively the \n“Service Providers”) from and against all losses, expenses, damages and \ncosts, including reasonable attorneys’ fees, resulting from any \nviolation of these terms and conditions or any activity related to your \naccount (including negligent or wrongful conduct) by you or any other \nperson accessing the site using your Internet account.&nbsp; * The following \nitems are not applicable to unconditional return policy: Perishable \ngoods – to ensure food safety, food hygiene and integrity, food products\n with no quality issues, cannot be returned. For packaging damage, \nleakage, deterioration and other issues, please contact our customer \nservice team and we would be happy to assist you.</p></div></div></div></div></div>');
