INSERT INTO `product` VALUES (87, '893621960202', 'Vietnam VANG LONG Green Bean Cake 42pcs 410g', '越南黄龙 绿豆糕 42个 410g', 1.18, '/uploads/黄龙绿豆糕.jpg', 0, 1, 1, '荣获越南产品质量高金奖', 125, '2018-05-18 03:36:44', '2018-09-20 01:09:55', 155, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"/uploads/黄龙绿豆糕.jpg\" style=\"max-width:100%;\"><img src=\"/uploads/黄龙绿豆糕1.jpg\" style=\"max-width: 100%;\"><img src=\"/uploads/黄龙绿豆糕3.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5 style=\"text-align: center;\"></h5><p></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">古传绿豆糕制法。</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">清热祛痘。</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">上学时校门口必买小零食之一。</span></p><p style=\"text-align: left;\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><span style=\"font-weight: bold;\">独立小包装，一小盒里有六小块，刚好一口吃掉，</span><span style=\"font-weight: bold;\">口感细腻香滑，入口即化，</span><span style=\"font-weight: bold;\">完全是小时候的味道！</span></span></p><p></p><p><img src=\"/uploads/黄龙绿豆糕.jpg\" style=\"max-width:100%;\"><img src=\"/uploads/黄龙绿豆糕1.jpg\" style=\"max-width: 100%;\"><img src=\"/uploads/黄龙绿豆糕3.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 40, '磅', 'pound', '件', 'package', 38.00, NULL, 180, NULL, NULL, NULL);
INSERT INTO `product` VALUES (88, '4517104600969', 'Eitaro Sakura Jelly 89g', '荣太楼 樱花果冻布丁 89g', 3.40, '/uploads/荣太楼 樱花果冻 1.jpg', 0, 1, 1, '果冻 送  情人 最好 礼物 樱花', 123, '2018-05-18 05:59:41', '2018-09-19 06:31:36', 89, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"/uploads/荣太楼 樱花果冻 1.jpg\" style=\"max-width:100%;\"><img src=\"/uploads/荣太楼 樱花果冻 2.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5 style=\"text-align: center;\"></h5><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">日本的老字号糕点铺荣太楼的历史最早可以追溯到1857年，遵循传统技艺的同时也在不断创新，时常有爆款诞生，比如这款樱花季限定果冻。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">透明的果冻里镶嵌着一整朵樱花，选用的是日本神奈川县西部丹泽山中栽培的八重樱。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">每一朵樱花都在开到八成的时候被采摘，才能保证呈现最美的样态。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">一年一度樱花限定果冻，荣太楼全球发售八万五千个樱花布丁。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">晶莹剔透、粉红靓丽，让打开布丁的你心情愉快！</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">口感细腻纯正，酸酸甜甜很清爽，带着天然樱花的香气，一点也不腻。</span></h5><p></p><h5 style=\"text-align: center;\"><img src=\"/uploads/荣太楼 樱花果冻 1.jpg\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans&quot;, sans-serif; max-width: 100%;\"><img src=\"/uploads/荣太楼 樱花果冻 2.jpg\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans&quot;, sans-serif; max-width: 100%;\"><br></h5><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 10, '磅', 'pound', '件', 'package', 18.80, NULL, 27, NULL, NULL, NULL);
INSERT INTO `product` VALUES (89, '84901551339699', 'Kracie Sakura Beauty Candy 32g', 'Kracie嘉娜宝 樱花香体糖 季节限定 32g', 1.70, '/uploads/Japan KRACIE Sakura Beauty Candy.jpg', 0, 1, 1, '糖果', 123, '2018-05-18 06:13:36', '2018-09-19 06:31:09', 25, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"/uploads/Japan KRACIE Sakura Beauty Candy.jpg\" style=\"max-width:100%;\"><img src=\"/uploads/Japan KRACIE Sakura Beauty Candy2.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5><div style=\"text-align: center;\"><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">“冰肌玉骨，自清凉无汗。水殿风来暗香满”</span></p></div><div style=\"text-align: center;\"><p style=\"text-align: left;\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><span style=\"font-weight: bold;\">美人自带暗香，</span><span style=\"font-weight: bold;\">作为女神也是如此！</span></span></p></div><div style=\"text-align: center;\"><p style=\"text-align: left;\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><span style=\"font-weight: bold;\">来自日本的约会帮手，混合浆果+樱花+胶原蛋白，</span><span style=\"font-weight: bold;\">粉嫩嫩的一颗少女心满溢。</span></span></p></div></h5><p><img src=\"/uploads/Japan KRACIE Sakura Beauty Candy.jpg\" style=\"max-width: 100%;\"><img src=\"/uploads/Japan KRACIE Sakura Beauty Candy2.jpg\" style=\"max-width: 100%;\"></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 10, '磅', 'pound', '件', 'package', 0.70, NULL, 420, NULL, NULL, NULL);
INSERT INTO `product` VALUES (91, '4942719603102', 'Tokyo Milk Cheese Factory Salt Camembett Cookies 10pcs 160g', '东京牛奶芝士工厂 海盐卡芒贝尔干酪饼干 10枚入 160g', 9.68, '/uploads/Untitled_1.jpg', 10, 1, 1, '饼干', 125, '2018-05-18 06:44:05', '2018-09-20 01:09:41', 84, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"/uploads/266A9239.jpg\" style=\"max-width:100%;\"><img src=\"/uploads/266A9269.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">被称为日本第一的牛奶芝士饼干从2011年开始，这个牌子在全世界卖出了超过5800万块饼干。</span></h5><p></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">他们做饼干所用的所有原材料，都确保是来自世界各地最好的材料。&nbsp;</span></h5><p></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">超人气伴手礼?</span></p><p></p><p></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">海盐芝士饼干，&nbsp;</span><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">使用了北海道的牛奶以及法国产的盖朗德盐之花制作，</span><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">中间夹的是法国产的卡芒贝尔芝士（Camembert）,&nbsp;</span><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">奶香浓郁，</span><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">柔滑爽口。</span></p><p><img src=\"/uploads/266A9239.jpg\" style=\"max-width:100%;\"><img src=\"/uploads/266A9269.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 10, '磅', 'pound', '件', 'package', 0.35, NULL, 180, NULL, NULL, NULL);
INSERT INTO `product` VALUES (92, '4901777317819', 'Starbucks Sparkling Refreshing Water 390ml', 'Starbucks 星巴克 气泡水 390ml', 1.10, '/uploads/Starbucks 碳酸水.jpg', 0, 2, 1, '饮料', 118, '2018-05-18 07:43:41', '2018-09-19 06:29:16', 164, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"/uploads/Starbucks 碳酸水.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">喝水也是有鄙视链的。</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">喝白开水的看不起喝凉水的， 喝矿泉水的看不起喝白开水的， 喝气泡水的看不起喝矿泉水的。&nbsp;</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">而气泡水一直处在鄙视链的顶端。&nbsp;</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">日本星巴克新推出的苏打水，十分网红。</span></p><p><img src=\"/uploads/Starbucks 碳酸水.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 24, '盎司', 'ounce', '瓶', 'bottle', 316.00, NULL, 150, NULL, NULL, NULL);
