INSERT INTO `product` VALUES (104, '4992440034713', 'ISHIZAWA LAB Keana Nadeshiko Rice Facial Mask For Women 10 sheets', '石泽研究所 毛穴抚子女士大米面膜 10片入', 9.90, '/uploads/大米面膜.jpg', 0, 1, 1, '面膜', 130, '2018-05-22 07:55:28', '2018-09-26 02:29:22', 32, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/大米面膜.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/大米面膜2.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">石泽研究所大米面膜是由日本原产大米提取制成，一袋10枚，非独立包装。<br></span></h5><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">一包含有165ml精华液，大米精华有嫩肤的作用，是为干燥肌肤所准备的护肤产品。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">敷上后清爽不黏腻，敷完后皮肤滑滑嫩嫩的，长时间使用可以有效改善毛孔问题。</span></p><div></div><p></p><div></div><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/大米面膜.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/大米面膜2.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：保湿䃼水，收缩毛孔，嫩肤亮白。（女士专用）</span></h5><div><br></div><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 10, '磅', 'pound', '袋', 'bag', 0.36, NULL, 1095, NULL, NULL, NULL);
INSERT INTO `product` VALUES (105, '4547315370597', 'MUJI Strawberry Marshmallow 97g', 'MUJI无印良品 草莓夹心棉花糖 97g', 1.34, '/uploads/MUJI 草莓棉花糖 1.jpg', 18, 1, 1, '糖果', 123, '2018-05-22 08:23:45', '2018-09-14 05:28:22', 33, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/MUJI 草莓棉花糖 1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/MUJI 草莓棉花糖 2.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small;\">可</span><span style=\"font-weight: bold; font-size: small;\">以直接吃</span></p><p><span style=\"font-weight: bold; font-size: small;\">也可以拿它做牛轧糖</span></p><p><span style=\"font-weight: bold; font-size: small;\">或者放进烤箱烤一烤也很不错呦</span></p><p><span style=\"font-weight: bold; font-size: small;\">果酱的酸味完美中和棉花糖的甜</span></p><p><span style=\"font-weight: bold; font-size: small;\">草莓的香味又浓超好吃外表真的很像消毒棉球。</span></p><p><span style=\"font-weight: bold; font-size: small;\">这一袋棉花糖和一串葡萄的热量差不多，算是比想象中要低了。</span></p><p><span style=\"font-weight: bold; font-size: small;\">雪白软萌的外表，蓬松细腻的手感，贩卖机老师表示能玩一年~</span></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/MUJI 草莓棉花糖 1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/MUJI 草莓棉花糖 2.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 10, '磅', 'pound', '袋', 'bag', 0.18, NULL, 80, NULL, NULL, NULL);
INSERT INTO `product` VALUES (106, '4897069530014', 'Jenny Bakery 4 Mix Butter Cookies 320g', '珍妮 聪明小熊 四味(牛油花 咖啡花 脆牛 葡萄燕麦)曲奇 320g 香港必买伴手礼', 18.50, '/uploads/小熊饼干.jpg', 0, 1, 1, '饼干 珍妮 聪明小熊 四味(牛油花 咖啡花 脆牛 葡萄燕麦)曲奇 320g 香港必买伴手礼', 125, '2018-05-23 02:37:41', '2018-09-29 01:30:35', 156, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/小熊饼干.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/小熊饼干1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/小熊饼干12buy.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/小熊饼干112buy.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/小熊饼干yami.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">珍妮曲奇是香港最好吃的曲奇饼干，广受各路达人和网友推崇，实属香港必吃小食+必败伴手礼。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">新鲜酥脆的饼干装进可爱的泰迪熊铁罐，内外兼修，人气爆棚，势不可挡。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">店家每1～2月便会更换一次曲奇饼干的包装罐，各种萌态的小熊轮番坐阵，让人欲罢不能。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/小熊饼干.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/小熊饼干12buy.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/小熊饼干112buy.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/小熊饼干yami.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 24, '磅', 'pound', '盒', 'box', 0.70, NULL, 30, NULL, NULL, NULL);
INSERT INTO `product` VALUES (107, '8885015022016', 'Singapore Irvins Salted Egg Fish Skin 105g', '新加坡Irvins 咸蛋鱼皮 网红限购 零食爱马仕 105g', 11.50, '/uploads/irvins fish skin.jpg', 10, 1, 1, '膨化', 121, '2018-06-08 06:23:28', '2018-09-20 01:10:19', 35, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/irvins fish skin.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/irvins 细节.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/irvins3.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/irvins fish skin2.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p data-spm-anchor-id=\"2013.1.0.i5.417e244bo91e7q\"><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><span data-spm-anchor-id=\"2013.1.0.i2.417e244bo91e7q\">炸鱼皮本是新加坡餐馆的传统小菜，Irvin把它“咸蛋化”之后，瞬间吸引了全球的吃货。</span><br></span></p><p data-spm-anchor-id=\"2013.1.0.i5.417e244bo91e7q\"><span data-spm-anchor-id=\"2013.1.0.i2.417e244bo91e7q\" style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">将鱼皮擦上一层橄榄油和一点海盐，通过空气炸锅炸，不仅含油量小了，更健康了，女孩子们可以放心的吃下去。<br></span></p><p data-spm-anchor-id=\"2013.1.0.i5.417e244bo91e7q\"><span data-spm-anchor-id=\"2013.1.0.i2.417e244bo91e7q\" style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">Irvins Salted Egg的包装上面有“危险！上瘾！”的红色标注。</span></p><p data-spm-anchor-id=\"2013.1.0.i5.417e244bo91e7q\"><span data-spm-anchor-id=\"2013.1.0.i2.417e244bo91e7q\" style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">打开袋子就能闻到浓浓的蛋黄味，可以看到整块鱼皮的形状，还有一些小辣椒和炸制的咖喱叶。<br></span></p><p data-spm-anchor-id=\"2013.1.0.i5.417e244bo91e7q\"><span data-spm-anchor-id=\"2013.1.0.i2.417e244bo91e7q\" style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">鱼皮很酥脆，吃起来有一点点辣，还有一点咸蛋黄沙沙的口感，蛋黄的味道很浓郁，但也不会喧宾夺主。</span></p><p data-spm-anchor-id=\"2013.1.0.i5.417e244bo91e7q\"><span data-spm-anchor-id=\"2013.1.0.i2.417e244bo91e7q\" style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><span data-spm-anchor-id=\"2013.1.0.i2.417e244bo91e7q\" style=\"\">IRVINS新加坡实体店</span><span data-spm-anchor-id=\"2013.1.0.i3.417e244bo91e7q\" style=\"\">几乎天天排长龙，</span><span data-spm-anchor-id=\"2013.1.0.i2.417e244bo91e7q\" style=\"\">每人每天限购5袋，当日卖完就关门。&nbsp;</span></span></p><p><img src=\"http://buy.yn-pulse.com/uploads/irvins fish skin.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/irvins 细节.jpg\" style=\"max-width: 100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/irvins3.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/irvins fish skin2.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 50, '磅', 'pound', '袋', 'bag', 0.50, NULL, 365, NULL, NULL, NULL);
