INSERT INTO `product` VALUES (135, '4987072071274', 'KOBAYASHI Eye Wash Green Gentle Clean 500ml', '小林制药 洗眼液 绿 超温和清洁 500ml', 8.56, '/uploads/小林洗眼液蓝色.jpg', 0, 1, 1, '洗眼液', 132, '2018-06-22 05:37:22', '2018-09-29 01:28:09', 41, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/YyBQqBqn_TD5H.jpg\"><br></p><p></p><p></p><p></p></p>', '<p><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">洗眼液可洗凈眼中异物灰尘，消除疲劳，消炎抗菌，保护角膜，预防眼部疾病的发生。适合长期佩戴隐形眼镜，长时间在办公室工作，</span><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">常常熬夜使用手机，和每天画眼妆的人们，男女都适用。</span></div><p></p><p style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><img src=\"http://buy.yn-pulse.com/uploads/YyBQqBqn_TD5H.jpg\" style=\"max-width:100%;\"><br></span></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><font style=\"background-color: rgb(0, 0, 0);\"><span style=\"color: rgb(255, 255, 255);\">绿 0度&nbsp;超温和清洁</span><br></font><span style=\"color: rgb(0, 0, 0);\">最温和，适合初次使用和眼睛敏感的人。这款的药理成分少，刺激比较低，含有维他命B6。</span><br><span style=\"color: rgb(0, 0, 0);\">功效：消炎，缓解疲劳，超温和清洁</span></span></h5><div><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></div><h5><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><u></u>1. 往洗眼杯中倒入5ml洗眼液，杯子上有5ml的提示线。</span></div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><font color=\"#000000\"><div style=\"text-align: center;\"><img height=\"147\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CF3oRwO1vu3qmJ5l5K4k18pryff3Z0fqqYQiaG4pXaj6TISicWm4Q8ZBg/640\" width=\"159\" 0.9224376731301939\"=\"\" data-w=\"722\" _width=\"159px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CF3oRwO1vu3qmJ5l5K4k18pryff3Z0fqqYQiaG4pXaj6TISicWm4Q8ZBg/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\"></div><div><br></div></font><font color=\"#000000\"><div>2. 洗眼杯高出的部位与外眼角对齐，低头将洗眼杯向上扣在眼部，就像在带泳镜一样。</div></font></span><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><img height=\"152\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CAFFeOdcSfdHiciaHqfXmKyuZOdVxfibgrafwFCJnXhl8A8LEhiaWbKYtdQ/640\" width=\"165\" 0.9196675900277008\"=\"\" data-w=\"722\" _width=\"165px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CAFFeOdcSfdHiciaHqfXmKyuZOdVxfibgrafwFCJnXhl8A8LEhiaWbKYtdQ/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\"></span></div><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></div><font color=\"#000000\"><div style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\">3. 在眼睛张开的状态下慢慢将头仰起，使洗眼液完全浸润眼睛。</div></font><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><img height=\"160\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CeD2nsEJZHzicib7qVjicib3CEqIsibbhsynd6T7bbXAFPAg1K9AOuP9SswQ/640\" width=\"175\" 0.9171270718232044\"=\"\" data-w=\"724\" _width=\"175px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CeD2nsEJZHzicib7qVjicib3CEqIsibbhsynd6T7bbXAFPAg1K9AOuP9SswQ/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\"></span></div><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></div><font color=\"#000000\"><div style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\">4. 眨眼数次，如果想清洗的比较彻底的话也可以转一转眼睛。 洗眼时间要控制在20-30秒中间，不要超过30秒。</div></font><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><img height=\"159\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4C7ia0x2CDZOeCiaYyHNJPeiaOW8MClCT2OMyPxzSias0uRMKTWfVHpg6uLg/640\" width=\"173\" 0.9196675900277008\"=\"\" data-w=\"722\" _width=\"173px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4C7ia0x2CDZOeCiaYyHNJPeiaOW8MClCT2OMyPxzSias0uRMKTWfVHpg6uLg/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\"></span></div><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></div><font color=\"#000000\"><div style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\">5. 洗完后慢慢低头，取下洗眼杯， 擦拭掉眼睛周围的洗眼液，用凈水冲洗眼杯，然后以同样的方法洗另一支眼睛。</div></font></h5><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><section></section><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 16, '磅', 'pound', '瓶', 'bottle', 1.30, NULL, 730, NULL, NULL, NULL);
INSERT INTO `product` VALUES (136, '4987072034088', 'KOBAYASHI Eye Wash Orange Moisturize 500ml', '小林制药 洗眼液 橘 玻尿酸保湿 500ml', 8.56, '/uploads/小林洗眼液橘色.jpg', 0, 1, 1, '洗眼液', 132, '2018-06-22 05:42:52', '2018-09-29 01:28:02', 41, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/G9c45TDk_uEUx.jpg\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">洗眼液可洗凈眼中异物灰尘，消除疲劳，消炎抗菌，保护角膜，预防眼部疾病的发生。适合长期佩戴隐形眼镜，长时间在办公室工作，常常熬夜使用手机，和每天画眼妆的小伙伴们。</span></h5><p style=\"text-align: center;\"><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><img src=\"http://buy.yn-pulse.com/uploads/G9c45TDk_uEUx.jpg\" style=\"max-width:100%;\"><br></font></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><font style=\"background-color: rgb(0, 0, 0);\"><span style=\"color: rgb(255, 255, 255);\">橘 2-3度 玻尿酸保湿</span><br></font><span style=\"color: rgb(0, 0, 0);\">微清凉，有轻微刺激感，适合眼睛经常干涩的人。这款添加了玻尿酸成分，可以大大的缓解眼睛干涩和疲劳。</span><br><span style=\"color: rgb(0, 0, 0);\">功效：消炎，润泽，长效高保湿</span></span></h5><p></p><p></p><div><u><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\">用法</font></u></div><h5><div><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><u></u>1. 往洗眼杯中倒入5ml洗眼液，杯子上有5ml的提示线。</font></div><div style=\"text-align: center;\"><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><img height=\"147\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CF3oRwO1vu3qmJ5l5K4k18pryff3Z0fqqYQiaG4pXaj6TISicWm4Q8ZBg/640\" width=\"159\" 0.9224376731301939\"=\"\" data-w=\"722\" _width=\"159px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CF3oRwO1vu3qmJ5l5K4k18pryff3Z0fqqYQiaG4pXaj6TISicWm4Q8ZBg/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\"></font></div><div><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><br></font></div><div><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\">2. 洗眼杯高出的部位与外眼角对齐，低头将洗眼杯向上扣在眼部，就像在带泳镜一样。</font></div><div style=\"text-align: center;\"><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><img height=\"152\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CAFFeOdcSfdHiciaHqfXmKyuZOdVxfibgrafwFCJnXhl8A8LEhiaWbKYtdQ/640\" width=\"165\" 0.9196675900277008\"=\"\" data-w=\"722\" _width=\"165px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CAFFeOdcSfdHiciaHqfXmKyuZOdVxfibgrafwFCJnXhl8A8LEhiaWbKYtdQ/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\"></font></div><div><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><br></font></div><div><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\">3. 在眼睛张开的状态下慢慢将头仰起，使洗眼液完全浸润眼睛。</font></div><div style=\"text-align: center;\"><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><img height=\"160\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CeD2nsEJZHzicib7qVjicib3CEqIsibbhsynd6T7bbXAFPAg1K9AOuP9SswQ/640\" width=\"175\" 0.9171270718232044\"=\"\" data-w=\"724\" _width=\"175px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CeD2nsEJZHzicib7qVjicib3CEqIsibbhsynd6T7bbXAFPAg1K9AOuP9SswQ/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\"></font></div><div><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><br></font></div><div><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\">4. 眨眼数次，如果想清洗的比较彻底的话也可以转一转眼睛。 洗眼时间要控制在20-30秒中间，不要超过30秒。</font></div><div style=\"text-align: center;\"><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><img height=\"159\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4C7ia0x2CDZOeCiaYyHNJPeiaOW8MClCT2OMyPxzSias0uRMKTWfVHpg6uLg/640\" width=\"173\" 0.9196675900277008\"=\"\" data-w=\"722\" _width=\"173px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4C7ia0x2CDZOeCiaYyHNJPeiaOW8MClCT2OMyPxzSias0uRMKTWfVHpg6uLg/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\"></font></div><div><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\"><br></font></div><div><font color=\"#000000\" style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\">5. 洗完后慢慢低头，取下洗眼杯， 擦拭掉眼睛周围的洗眼液，用凈水冲洗眼杯，然后以同样的方法洗另一支眼睛。</font></div></h5><p><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><section></section><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 16, '磅', 'pound', '瓶', 'bottle', 1.30, NULL, 730, NULL, NULL, NULL);
