比较彻底的话也可以转一转眼睛。 洗眼时间要控制在20-30秒中间，不要超过30秒。</div></font><div style=\"text-align: center;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><img height=\"159\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4C7ia0x2CDZOeCiaYyHNJPeiaOW8MClCT2OMyPxzSias0uRMKTWfVHpg6uLg/640\" width=\"173\" 0.9196675900277008\"=\"\" data-w=\"722\" _width=\"173px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4C7ia0x2CDZOeCiaYyHNJPeiaOW8MClCT2OMyPxzSias0uRMKTWfVHpg6uLg/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\"></span></div><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></div><font color=\"#000000\"><div style=\"font-weight: bold; font-size: small; font-family: 微软雅黑;\">5. 洗完后慢慢低头，取下洗眼杯， 擦拭掉眼睛周围的洗眼液，用凈水冲洗眼杯，然后以同样的方法洗另一支眼睛。</div></font></h5><p style=\"text-align: center;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 16, '磅', 'pound', '瓶', 'bottle', 1.30, NULL, 730, NULL, NULL, NULL);
INSERT INTO `product` VALUES (138, '4987072071281', 'KOBAYASHI Eye Wash VitaminB6+B12 500ml', '小林制药 洗眼液 粉 维他命B6+B12 500ml', 8.56, '/uploads/58c25e70N42a4973e.jpg', 30, 1, 1, '洗眼液', 132, '2018-06-22 05:53:05', '2018-09-20 01:08:19', 41, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/58c25e70N42a4973e.jpg\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5 style=\"text-align: center;\"><div style=\"text-align: left;\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">洗眼液可洗凈眼中异物灰尘，消除疲劳，消炎抗菌，保护角膜，预防眼部疾病的发生。适合长期佩戴隐形眼镜，长时间在办公室工作，</span></div><div style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">常常熬夜使用手机，和每天画眼妆的人们，男女都适用。</span><br></div><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><img src=\"http://buy.yn-pulse.com/uploads/58c25e70N42a4973e.jpg\" style=\"max-width:100%;\"><br></span></h5><div><span style=\"background-color: rgb(0, 0, 0); color: rgb(255, 255, 255); font-family: 微软雅黑; font-size: small; font-weight: bold;\"><br></span></div><div><span style=\"background-color: rgb(0, 0, 0); color: rgb(255, 255, 255); font-family: 微软雅黑; font-size: small; font-weight: bold;\">粉 3-4度&nbsp;维他命B6+B12</span><br></div><h5><div style=\"\"><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">中度清凉，有一定的刺激感，适合用眼过度，眼睛经常感到不适的人使用。这款含有双倍维生素 (B6和B12) ，可以改善眼睛代谢机能。</span></div><div style=\"\"><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">功效：消炎，护理，补充营养</span></div></h5><h5 style=\"text-align: center;\"></h5><p></p><h5 style=\"text-align: center;\"><div style=\"text-align: left;\"><u style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">用法</u></div><div style=\"text-align: left;\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><u style=\"text-decoration-line: underline;\"></u>1. 往洗眼杯中倒入5ml洗眼液，杯子上有5ml的提示线。</span></div><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><div style=\"text-align: center;\"><img height=\"147\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CF3oRwO1vu3qmJ5l5K4k18pryff3Z0fqqYQiaG4pXaj6TISicWm4Q8ZBg/640\" width=\"159\" 0.9224376731301939\"=\"\" data-w=\"722\" _width=\"159px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CF3oRwO1vu3qmJ5l5K4k18pryff3Z0fqqYQiaG4pXaj6TISicWm4Q8ZBg/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\" style=\"max-width: 100%;\"></div><div style=\"text-align: center;\"><br></div><div style=\"text-align: left;\">2. 洗眼杯高出的部位与外眼角对齐，低头将洗眼杯向上扣在眼部，就像在带泳镜一样。</div><span><div style=\"text-align: center;\"><img height=\"152\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CAFFeOdcSfdHiciaHqfXmKyuZOdVxfibgrafwFCJnXhl8A8LEhiaWbKYtdQ/640\" width=\"165\" 0.9196675900277008\"=\"\" data-w=\"722\" _width=\"165px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CAFFeOdcSfdHiciaHqfXmKyuZOdVxfibgrafwFCJnXhl8A8LEhiaWbKYtdQ/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\" style=\"\"></div><div style=\"text-align: center;\"><br></div></span><div style=\"text-align: left;\">3. 在眼睛张开的状态下慢慢将头仰起，使洗眼液完全浸润眼睛。</div><span><div style=\"text-align: center;\"><img height=\"160\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CeD2nsEJZHzicib7qVjicib3CEqIsibbhsynd6T7bbXAFPAg1K9AOuP9SswQ/640\" width=\"175\" 0.9171270718232044\"=\"\" data-w=\"724\" _width=\"175px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4CeD2nsEJZHzicib7qVjicib3CEqIsibbhsynd6T7bbXAFPAg1K9AOuP9SswQ/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\" style=\"\"></div><div style=\"text-align: center;\"><br></div></span><div style=\"text-align: left;\">4. 眨眼数次，如果想清洗的比较彻底的话也可以转一转眼睛。 洗眼时间要控制在20-30秒中间，不要超过30秒。</div><span><div style=\"text-align: center;\"><img height=\"159\" data-src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4C7ia0x2CDZOeCiaYyHNJPeiaOW8MClCT2OMyPxzSias0uRMKTWfVHpg6uLg/640\" width=\"173\" 0.9196675900277008\"=\"\" data-w=\"722\" _width=\"173px\" src=\"https://mmbiz.qpic.cn/mmbiz_png/ymdWyHQMR5LOo9VhibIHlbSH1ZP3wKD4C7ia0x2CDZOeCiaYyHNJPeiaOW8MClCT2OMyPxzSias0uRMKTWfVHpg6uLg/640?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" data-fail=\"0\" style=\"\"></div><div style=\"text-align: center;\"><br></div></span><div style=\"text-align: left;\">5. 洗完后慢慢低头，取下洗眼杯， 擦拭掉眼睛周围的洗眼液，用凈水冲洗眼杯，然后以同样的方法洗另一支眼睛。</div></span></h5><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><section></section><p style=\"text-align: left;\"></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: left;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 16, '磅', 'pound', '瓶', 'bottle', 1.30, NULL, 730, NULL, NULL, NULL);
