INSERT INTO `product` VALUES (142, '4977950614631', 'MARUTAMA Crab Stick 45g', '丸玉水产 北海道 长脚蟹肉棒 45g', 0.92, '/uploads/丸玉水产 蟹肉棒.jpg', 0, 1, 1, '蟹肉 棒 丸玉水产 北海道 长脚蟹肉棒 45g', 122, '2018-06-23 08:55:07', '2018-09-19 06:01:06', 61, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E4%B8%B8%E7%8E%89%E6%B0%B4%E4%BA%A7%20%E8%9F%B9%E8%82%89%E6%A3%92.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E8%9F%B9%E6%A3%92%20%E7%BB%86%E8%8A%82%201.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E8%9F%B9%E6%A3%92%20%E7%BB%86%E8%8A%82%202.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E8%9F%B9%E6%A3%92%20%E7%BB%86%E8%8A%82%203.jpg\"></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5></h5><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">日本著名的水产企业“丸玉水产”生产，北海道深海长脚蟹制成，耐嚼爽口，蟹味足，正宗的来自深海的美味。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">北海道长脚蟹柳，富含蛋白质、微量元素，营养又美味，丝丝分明，鲜甜美味，给你一场味觉盛宴。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">熬夜升级打怪兽，加班赶稿追进度，考级刷分磕书本，无论何时，来条蟹肉卷，能量又回来了！让你感受鲜甜的味道在齿间丝丝流淌。</span></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/丸玉水产 蟹肉棒.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/蟹棒 细节 1.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/蟹棒 细节 2.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/蟹棒 细节 3.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 15, '盎司', 'ounce', '件', 'package', 1.60, NULL, 90, NULL, NULL, NULL);
INSERT INTO `product` VALUES (143, '4901872837144', 'SHISEIDO fino Premium Touch Hair Mask 230g', '资生堂 fino 高效浸透修复发膜 受损发专用 Hair Mask 230g', 7.70, '/uploads/FINO 发膜.jpg', 100, 1, 1, '发膜', 128, '2018-06-29 02:13:19', '2018-09-29 01:27:45', 31, '<p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/FINO%20%E5%8F%91%E8%86%9C.jpg\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">资生堂fino发膜含有7种美容液营养成分，能够深入渗透修护毛鳞片，强力补充头发饱满所需要的营养成分。</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">可以深入渗透修护毛鳞片，充分补充头发所需要的营养成分。</span><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/FINO 发膜.jpg\" style=\"max-width:100%;\"><br></p><h5 style=\"text-align: left;\"><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 洗发后将头发擦至半干，取适量发膜均匀涂抹在受损的头发上，静待5至15分钟后用清水洗净即可。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 依每个人不同需求，发膜护理可一周一次至一周数次。</span></h5><div><br></div><p></p><p></p><p></p><p></p><p></p></p>', 36, '磅', 'pound', '只', 'piece', 0.50, NULL, 1000, NULL, NULL, NULL);
