INSERT INTO `product` VALUES (158, '4901872073696', 'SHISEIDO Anessa Perfect UV Sunscreen Skincare Milk SPF50+ PA++++ 60ml', '资生堂 Anessa安耐晒 超防水防晒霜 金瓶 SPF50+ PA++++ 60ml', 29.03, '/uploads/Anessa 金瓶 60ml.jpg', 160, 1, 1, '安耐晒', 127, '2018-07-26 06:24:42', '2018-09-19 05:51:24', 31, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/Anessa%20%E9%87%91%E7%93%B6%2060ml.jpg\"><br></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">安耐晒可谓是防晒界的王牌，连续14年日本人气冠军防晒品牌，凭借着超前技术和无数消费者口碑，已成为大众心目中NO.1的防晒品牌。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Anessa 金瓶 60ml.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">安耐晒金瓶有50%是护肤成分。</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">金瓶不粘不油，酒精成分比较高，耐受皮肤或偏油皮肤可以上脸。（敏感皮肤或偏干皮肤想要上脸的话最好是用粉金瓶）</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">成膜后是哑光感的，超级防水，适合长时间外出，上山下海。</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2018年新升级后，质地比之前水润很多，几乎没有油膜感。</span></p><p></p><p></p><p></p><p></p><p></p><p></p><ul><li><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">防晒指数：SPF50+&nbsp;，PA++++<br></span></li><li><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">适用部位：脸上&nbsp;/身上可用（敏感肌不建议上脸）</span></p></li><li><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">质地：水乳状（用前需摇），流动性非常好，好涂抹开，不泛白</span></p></li></ul><div><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: 700;\"><br></span></div><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 0.17, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (159, '4902102123181', 'Coca Cola Plus 470mL', '可口可乐 零卡 减脂可乐 470mL', 1.10, '/uploads/减肥可乐.jpg', 0, 1, 1, '减肥 可乐 日本', 118, '2018-07-26 06:30:07', '2018-09-19 05:50:53', 159, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/减肥可乐.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><h5><div style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">该产品通过了日本特定保健食品认证。</span></div><div style=\"text-align: left;\"><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">不仅无糖还加入了“难消化性麦芽糊精”，</span></div><div style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">这种膳食纤维可有效抑制脂肪吸收、稳定血脂。</span></div><div style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">在官方公布的测试数据当中，</span></div><div style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">对甘油三酯的抑制高达 7% 。</span></div><div style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">佛系减肥舍我其谁！</span></div></h5><p><img src=\"http://buy.yn-pulse.com/uploads/减肥可乐.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 24, '磅', 'pound', '瓶', 'bottle', 26.90, NULL, 150, NULL, NULL, NULL);
