/span></li><ul><li><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">适用部位：脸上&nbsp;/身上都可用</span></p></li><li><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">质地：水乳状（用前需摇），流动性好，好涂抹开，不泛白</span></p></li></ul><div><br></div><p></p><p></p><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 0.17, NULL, 1000, NULL, NULL, NULL);
