2至3滴，一日4到5次。</span></h5><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></div><p></p></p>', 240, '磅', 'pound', '瓶', 'bottle', 0.08, NULL, 1000, NULL, NULL, NULL);
