INSERT INTO `product` VALUES (187, '4966680246762', 'Propolinse Dental Whitening Mouth Wash 600ml', 'Propolinse Mouth Wash 比那氏 蜂胶复合漱口水 美白 600ml', 7.63, '/uploads/美白正面.jpg', 0, 1, 1, '漱口水', 126, '2018-07-26 08:20:42', '2018-09-29 01:25:23', 106, '<p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E7%BE%8E%E7%99%BD%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E7%BE%8E%E7%99%BD%E8%83%8C%E9%9D%A2.jpg\"></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><div data-v-a16c5c68=\"\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">口臭、口腔发炎、牙龈出血、牙菌斑、蛀牙都是靠普通刷牙是没办法解决的！<br></span></div><p></p><div data-v-a16c5c68=\"\"></div><p></p><p style=\"text-align: center;\"></p><p></p><p></p><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">这款Propolinse比那氏漱口水萃取了洁白洗牙粉末，漱口的时候能让粉末“擦拭”牙齿，达到亮白牙齿的效果。</span></h5><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/美白正面.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/美白背面.jpg\" style=\"max-width:100%;\"><br></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">功效：简单30秒，有效将口腔中蛋白质污垢固化，清新口气，防止口臭，美白牙齿，口腔清爽，预防口腔问题。</span></p><p></p><p></p><p data-v-331b5d4b=\"\"><u style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">用法</u></p><p data-v-331b5d4b=\"\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">取10-15ml（大约是半个瓶盖）漱口水，将漱口水含在嘴里，鼓动两腮与唇部。让其在口腔内能充分与牙齿、牙龈接触，30秒之后吐掉。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><br></span></p><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 1.52, NULL, 365, NULL, NULL, NULL);
INSERT INTO `product` VALUES (188, '4966680245741', 'Propolinse Dental Mouth Wash 600ml', 'Propolinse Mouth Wash 比那氏 蜂胶复合漱口水 600ml', 5.65, '/uploads/蜂蜜正面.jpg', 0, 1, 1, '漱口水', 126, '2018-07-26 08:25:49', '2018-09-29 01:25:22', 106, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E8%9C%82%E8%9C%9C%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E8%9C%82%E8%9C%9C%E8%83%8C%E9%9D%A2.jpg\"></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><div data-v-a16c5c68=\"\"><div data-v-a16c5c68=\"\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">口臭、口腔发炎、牙龈出血、牙菌斑、蛀牙都是靠普通刷牙是没办法解决的！<br></span></div></div><p></p><h5 style=\"text-align: left;\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">这款Propolinse比那氏漱口水使用了天然蜂胶，带有酸酸的味道。漱完吐出会有块状脏东西，是口腔内固化的蛋白质污垢。可以有效的清洁牙齿！</span></h5><h5 style=\"text-align: left;\"><img src=\"http://buy.yn-pulse.com/uploads/蜂蜜正面.jpg\" style=\"max-width: 100%;\"></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/蜂蜜背面.jpg\" style=\"max-width:100%;\"><br></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">功效：简单30秒，有效将口腔中蛋白质污垢固化，清新口气，防止口臭，美白牙齿，口腔清爽，预防口腔问题。</span></p><p></p><p></p><p data-v-331b5d4b=\"\"><u style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">用法</u></p><p data-v-331b5d4b=\"\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">取10-15ml（大约是半个瓶盖）漱口水，将漱口水含在嘴里，鼓动两腮与唇部。让其在口腔内能充分与牙齿、牙龈接触，30秒之后吐掉。</span></p><p data-v-331b5d4b=\"\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 1.52, NULL, 365, NULL, NULL, NULL);
