INSERT INTO `product` VALUES (196, '4903301025719', 'Lion PAIR Acne Cream 14g', '狮王 PAIR 祛粉刺暗疮痘印祛痘膏 14g', 6.12, '/uploads/pair正面.jpg', 0, 1, 1, '祛痘膏', 130, '2018-07-27 00:47:57', '2018-09-19 05:30:03', 117, '<p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/pair%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/pair%E8%83%8C%E9%9D%A2.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/pair%E9%87%8C%E9%9D%A2.jpg\"></p><p></p></p>', '<p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">狮王 Pair祛痘膏是专为成人痘设计的抗痘产品。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">针对的是由不规则生活习惯、内分泌失调、皮脂分泌过剩、精神压力等原因导致的痘痘。</span></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">含有消炎的成分和抗菌的成分，主要功效可以抑制痘痘炎症，杀死促使痘痘恶化的痤疮杆菌。</span></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/pair正面.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/pair背面.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">对正在生长的痘痘可以抑制并消除。</span></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">对已经成熟的痘痘可以析出脂肪粒（脓包）。</span></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/pair里面.jpg\" style=\"max-width:100%;\"><br></p><p><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 在使用祛痘膏之前，先將臉部清潔乾淨，最好选用溫和的弱酸性洗面乳。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 洗完脸之后使用適合自己的化妝水滋潤。</span></p><p></p><section data-width=\"100%\"><section><section><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">3. 將祛痘膏擠出適量到指尖，塗抹到痘痘的患處。盖住痘痘就可以了，不用太厚。要是特别肿大的话，可以挤多一点，敷在痘痘上。</span></p></section></section></section><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">4. 等祛痘膏吸收了之后，再进行保湿等护理。（建议使用温和的乳液或补水喷雾）</span></p><p><br></p></p>', 10, '磅', 'pound', '只', 'piece', 0.06, NULL, 1000, NULL, NULL, NULL);
