INSERT INTO `product` VALUES (215, '4903111478064', 'UNICHARM Silcot Uruuru Sponge Facial Cotton 40pcs', 'UNICHARM尤妮佳 1/2省水超吸收化妆棉 40片入', 2.20, '/uploads/Untitled_53.jpg', 0, 1, 1, '化妆棉', 129, '2018-07-27 02:42:15', '2018-09-29 01:24:04', 55, '<p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Untitled-53.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Untitled-4.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Untitled-32.jpg\"><br></p><p style=\"text-align: center;\"><br></p><p></p><p></p></p>', '<p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">采用天然棉经高温消毒制成的1/2省水化妆棉，如同名字一样吸收性强，非常省水。</span></h5><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">吸水后有惊人的保湿能力，化妆棉整体是封闭式结构，所以在使用过程中不会破损或有纤维残留在脸上。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">化妆棉的边边是弧形的，方便湿敷的时候鼻子下巴眼睛的部位。也可以根据自己的需求剪成各种形状进行化妆水湿敷。</span></h5><div></div><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Untitled-53.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Untitled-4.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">虽然是40片，但实际是80片，非常划算。浸透后又可再拆成两片，可以说最多有160片可用。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Untitled-32.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p></p>', 36, '磅', 'pound', '盒', 'box', 0.11, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (216, '4903111455546', 'SILCOT Facial Cotton Puff 82pcs', 'UNICHARM尤妮佳 超柔软化妆棉 82片入', 1.88, '/uploads/Untitled_3.jpg', 0, 1, 1, '化妆棉', 129, '2018-07-27 02:46:02', '2018-09-29 01:23:59', 55, '<p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/Untitled-3.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/Untitled-21.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/Untitled-31.jpg\"></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">尤妮佳超柔软化妆棉的表层是天然棉，柔软平滑不粗糙。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">触感轻柔，压脚细密，防止水分流失，吸水更饱满。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Untitled-3.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Untitled-21.jpg\" style=\"max-width:100%;\"><br></p><h5 style=\"text-align: left;\">两层心，表面天然棉，内层由特别的纯棉制造。<br>主打的是轻柔触感，减少和肌肤的摩擦感。</h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Untitled-31.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p></p>', 30, '磅', 'pound', '盒', 'box', 0.17, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (217, '4582305063462', 'Lululun Daily Moisturizing Facial Mask 7 sheets', 'Lululun 每日护肤滋润面膜 7片入', 3.30, '/uploads/Lululun 化妆水面膜 1.jpg', 35, 1, 1, '面膜', 130, '2018-07-27 03:05:44', '2018-09-19 05:19:01', 63, '<p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/Lululun%20%E5%8C%96%E5%A6%86%E6%B0%B4%E9%9D%A2%E8%86%9C%201.jpg\"><br></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/Lululun%20%E5%8C%96%E5%A6%86%E6%B0%B4%E9%9D%A2%E8%86%9C%202.jpg\"></p><p></p></p>', '<p><p></p><p></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">Lululun每日护肤滋润面膜是每天使用的，不会给肌肤增加太多负担，只是起到补水醒肤的作用。<br></span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">妆前敷一片，可以快速醒肤，为肌肤补水，让妆容更服帖。</span></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">卸妆后敷一片，可以保持肌肤的清爽度和饱水度，让护肤品更容易吸收，使肌肤在夜间得到有效滋养。</span></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Lululun 化妆水面膜 1.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/Lululun 化妆水面膜 2.jpg\" style=\"max-width:100%;\"><br></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">无香料，无矿物油，无着色。<br></span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">四季适用滋润型。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：补水，嫩肤，醒肤。</span></h5><p></p><p></p><p></p></p>', 20, '磅', 'pound', '袋', 'bag', 0.30, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (218, '4992440036021', 'ISHIZAWA LAB Keana Nadeshiko Rice Facial Mask For Men 10 sheets', '石泽研究所  毛穴抚子男士大米面膜 10片入', 8.80, '/uploads/大米面膜男.jpg', 0, 1, 1, '面膜', 130, '2018-07-27 03:54:57', '2018-09-29 01:23:51', 32, '<p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E5%A4%A7%E7%B1%B3%E9%9D%A2%E8%86%9C%E7%94%B7.jpg\"><br></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E5%A4%A7%E7%B1%B3%E9%9D%A2%E8%86%9C%E7%94%B7%202.jpg\"></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">石泽研究所大米面膜是由日本原产大米提取制成，一袋10枚，非独立包装。<br></span></h5><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">一包含有165ml精华液，大米精华有嫩肤的作用，是为干燥肌肤所准备的护肤产品。<br></span></h5><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">敷上后清爽不黏腻，敷完后皮肤滑滑嫩嫩的，长时间使用可以有效改善毛孔问题。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/大米面膜男.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/大米面膜男 2.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：保湿䃼水，收缩毛孔。（男士专用）</span></h5><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></div><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '袋', 'bag', 0.38, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (219, '4526371017646', 'Pure Smile CHOOSY Milk Lip Mask', 'Pure Smile CHOOSY 牛奶唇膜', 0.89, '/uploads/choosy blue.jpg', 20, 1, 1, '唇膜', 130, '2018-07-27 04:10:55', '2018-09-20 01:12:04', 74, '<p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/choosy%20blue.jpg\"><br></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/choosy%20blue2.jpg\"></p></p>', '<p><p></p><p></p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">CHOOSY唇膜是Q嫩嫩的果冻凝胶质地。</span></h5><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">平平的一张唇膜贴到嘴上就像3D立体唇膜，嘴唇的凹凸部分都能覆盖，100%的贴合度。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/choosy blue.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/choosy blue2.jpg\" style=\"max-width:100%;\"><br></p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：保湿，补充水分，弹力紧实，改善细纹、干裂、起皮。</span></h5><p></p><p></p><p></p><p></p><div><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></div><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 洗完脸后，唇部去角质（可去可不去）。</span></p><p></p><p></p><p></p><div><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 把唇膜敷在嘴巴上5-30分钟后，揭掉即可。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></p></div></p>', 10, '磅', 'pound', '片', 'sheet', 0.01, NULL, 1000, NULL, NULL, NULL);
