INSERT INTO `product` VALUES (229, '4560264293731', 'SHINYAKOSO Night Diet Enzyme Plus 30 packs', '新谷 夜晚吃多少都可以 瘦身酵素 加强版 30包入', 28.12, '/uploads/夜晚吃多少都可以酵素 1.jpg', 15, 1, 1, '酵素', 136, '2018-07-27 04:46:49', '2018-09-20 02:10:32', 165, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E5%A4%9C%E6%99%9A%E5%90%83%E5%A4%9A%E5%B0%91%E9%83%BD%E5%8F%AF%E4%BB%A5%E9%85%B5%E7%B4%A0%201.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E5%A4%9C%E6%99%9A%E5%90%83%E5%A4%9A%E5%B0%91%E9%83%BD%E5%8F%AF%E4%BB%A5%E9%85%B5%E7%B4%A0%202.jpg\"></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">新谷酵素有着吸引人的三大功效----抑制糖份吸收，燃烧过剩能量，调整易瘦体质。<br></span></p><p></p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">要知道，晚饭吃得晚、夜宵、零食都是减肥的大敌，新谷酵素就是对抗这些最好的帮手。<br></span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">经典版加入了姜黄和生姜成分，增强了酵素的分解力。</span></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/夜晚吃多少都可以酵素 1.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/夜晚吃多少都可以酵素 2.jpg\" style=\"max-width: 100%;\"><br></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><u style=\"\">用法</u></span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 一盒30包，一包6粒。<br></span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 一天1-3包（6-18粒）。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">3. 饭前/睡前 30分钟冷水或温水吞服。</span></h5><div><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><br></span></div><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '盒', 'box', 0.22, NULL, 1000, NULL, NULL, NULL);
