INSERT INTO `product` VALUES (233, '4977240003633', 'HORI Pure Jelly Melon Flavor 12pcs', 'HORI 哈密瓜果冻 12枚入', 5.81, '/uploads/q1.jpg', 0, 1, 1, 'HORI 哈密瓜果冻', 123, '2018-07-27 05:03:19', '2018-09-20 01:04:59', 69, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/1519090141.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1519090169.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1519090183.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1519090197.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5><div style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">北海道最高级的水果莫属连续5年获金奖的夕张哈密瓜了，<br></span></div></h5><p></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">但是一个哈密瓜价格上千元还是让我吃点哈密瓜果冻压压惊吧！&nbsp;</span></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">这款哈密瓜果冻口感非常奇妙，吃起来就跟真的夕张红肉哈密瓜一样。</span></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\"><span title=\"\">曾超过了白色恋人</span><span title=\"\">，</span><span title=\"\">薯条三兄弟等名产拿到第一名，</span></span></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">不经意间还能吃到香浓的哈密瓜果肉。</span></p><h5><span title=\"\"><div style=\"text-align: center;\"><span title=\"\"></span></div></span></h5><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/1519090141.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1519090169.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1519090183.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1519090197.jpg\"