INSERT INTO `product` VALUES (234, '4560202020641', 'NURSERY Cleansing Gel with Yuzu Extract 180ml', 'NURSERY 柚子卸妆啫喱 180ml', 12.10, '/uploads/nursery yuzu1.jpg', 50, 1, 1, '卸妆啫喱', 130, '2018-07-27 05:06:46', '2018-09-19 05:04:21', 94, '<p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/nursery%20yuzu1.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/nursery%20yuzu12.jpg\"></p><p></p></p>', '<p><p></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">NURSERY柚子卸妆啫喱，卸妆洁面二合一。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">啫喱比卸妆水清爽，比卸妆油温和。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">加入了柚子精华，在保湿的效果上还有天然柚子香。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/nursery yuzu1.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/nursery yuzu12.jpg\" style=\"max-width:100%;\"><br></p><h5 style=\"text-align: left;\"><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 在干的手上挤压适量卸妆啫喱。（挤压于化妆棉上也可以）</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 涂抹全脸或需卸妆部位。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">3. 双手轻轻按摩全脸直到化妆品浮面，洗净即可</span></h5><div><br></div><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 0.51, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (235, '4901301230638', 'KAO Merries Pants Diaper Size L For 9~14kg Baby 44pcs', 'KAO花王 Merries 幼儿拉拉裤 L号 9~14kg 44枚入', 13.54, '/uploads/花王拉拉裤 L.jpg', 0, 1, 1, 'KAO花王 Merries 婴幼儿 纸尿裤 拉拉裤 L号 9~14kg 44枚入', 117, '2018-07-27 05:12:05', '2018-09-19 05:03:36', 40, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/花王拉拉裤L号.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">弹力腰围，方便穿脱，柔软舒适不紧绷。<br></span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">出汗区的排气通道不断排出闷热湿气，尿湿区的快速透气外表层也能将湿气迅速排出，让肌肤持久干爽。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">站走时两侧吸收体自然立起，形成W型窄档，方便活动；蹲坐时裆部又自动变宽，有效避免漏尿的发生。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">内表层采用了细致的纤维材质，轻柔包裹宝宝的小屁屁。</span></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/花王拉拉裤L号.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 3, '磅', 'pound', '包', 'bale', 3.00, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (236, '4901037246514', 'YOSHIMI Corn Crisps 108g', 'YOSHIMI 玉米烧仙贝 #北海道限定# 日本果子大赛冠军 108g', 8.50, '/uploads/product_1_2018_03_21_11_34_03.jpg', 0, 1, 1, 'YOSHIMI 玉米烧仙贝', 121, '2018-07-27 05:13:21', '2018-09-19 05:02:40', 79, '<p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/1521657145.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><h5></h5><p></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">YOSHIMI 札幌仙贝玉米烧，是当年日本果子大赛的冠军美食。&nbsp;</span></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">这是一款承载日本怀旧情怀的超人气零食，以前公园门口有很多拷玉米的摊位，现在已经找不到，所以日本人很是相恋满街玉米的味道，这款玉米烧就诞生了，在日本口碑相传。&nbsp;</span></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">北海道的昼夜温差大，所以产的玉米特别好吃，</span></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">这款烧玉米仙贝是咸口味的，没有油腻感，玉米味十分香浓，</span></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">打开以后里面含有鲜玉米粒和玉米仙贝两部分，所以咸当中又能品尝出淡淡玉米微甜来。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/1521657145.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', 24, '磅', 'pound', '盒', 'box', 0.38, NULL, 90, NULL, NULL, NULL);
INSERT INTO `product` VALUES (237, '4987188201244', 'Hisamitsu Muscle Pain Relief Patch 7pcs', '久光制药 肌肉镇痛贴 Hisamitsu Muscle Pain Relief Patch 7片入', 5.09, '/uploads/久光正面.jpg', 78, 1, 1, '肌肉酸痛', 136, '2018-07-27 05:21:48', '2018-09-19 05:02:02', 126, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E4%B9%85%E5%85%89%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E4%B9%85%E5%85%89%E8%83%8C%E9%9D%A2.jpg\"><br></p><p><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5 style=\"text-align: left;\"><span style=\"font-family: 微软雅黑; font-weight: bold; font-size: small; color: rgb(0, 0, 0);\">久光制药镇痛贴适用于腰痛，肌肉痛，关节痛，腱鞘炎，肩痛，跌打风湿引起的各种疼痛。</span></h5><h5><span style=\"font-family: 微软雅黑; font-weight: bold; font-size: small; color: rgb(0, 0, 0);\">效力能持续24小时，有效舒缓肌肉劳损及工作引起的各种痛症，迅速恢复最佳状态。</span></h5><h5><span style=\"font-family: 微软雅黑; font-weight: bold; font-size: small; color: rgb(0, 0, 0);\">比起传统膏药，少了浓重的药味，而是淡淡的薄荷味。</span></h5><h5><img src=\"http://buy.yn-pulse.com/uploads/久光正面.jpg\" style=\"text-align: center; max-width: 100%;\"></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/久光背面.jpg\" style=\"max-width:100%;\"><br></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><u style=\"\">用法</u></span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1天1次贴于疼痛处。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">清洁患部后，揭掉透明的膜贴在患处，使用最多24小时揭掉。</span></h5><div><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><br></span></div><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 80, '磅', 'pound', '包', 'bale', 0.10, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (238, '4903059305491', 'Hokkaido Scallop Cheese 120g', '北海道 芝士帆立贝 120g', 9.10, '/uploads/unnamed.png', 0, 1, 1, '芝士帆立贝', 121, '2018-07-27 05:35:47', '2018-09-19 05:00:30', 46, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/unnamed.png\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">帆立贝营养丰富，富含蛋白质、脂肪、糖以及微量元素矿物质、核黄素、尼克酸。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">据现代科学家研究，每100克帆立贝有50克蛋白质，帆立贝干则有60多克蛋白质。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">大颗饱满！每一粒独立包装，粒粒精选，无添加剂，</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">鲜甜的帆立贝搭配上浓浓的奶香味芝士块，绝妙的口感让人吃了如同上瘾一般停不下来。</span></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/unnamed.png\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 10, '磅', 'pound', '包', 'bale', 0.30, NULL, 150, NULL, NULL, NULL);
INSERT INTO `product` VALUES (239, '4901305410586', 'Kataoka Sakura Matcha Milk 180g', '辻利 抹茶牛奶樱花茶 180g', 4.57, '/uploads/抹茶牛奶樱花茶正面.jpg', 30, 1, 1, '抹茶牛奶樱花茶', 118, '2018-07-27 06:05:40', '2018-09-19 05:00:15', 87, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/1525391972.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1525391988.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">由日本京都宇治总本家辻利出品，抹茶品牌中的元老。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">樱花与抹茶牛奶的结合，微微的甜度，味道香醇浓厚，冷热都可以冲泡，在家也能泡出好喝的日本抹茶牛奶。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">辻利的茶匠严选出的宇治抹茶，与浓郁的牛奶调和，再加入日本国产樱叶粉，是非常珍贵特别的口味哦！</span></h5><p style=\"text-align: center;\"><img src=\"http://image.135editor.com/files/users/418/4187105/201805/Nq65EgsE_LzbX.jpg\" alt=\"nr_milk.jpg\" _src=\"http://image.135editor.com/files/users/418/4187105/201805/Nq65EgsE_LzbX.jpg\"></p><p></p><p><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/1525391972.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1525391988.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 10, '磅', 'pound', '包', 'bale', 0.42, NULL, 360, NULL, NULL, NULL);
