INSERT INTO `product` VALUES (243, '4971749110335', 'MR.TAILANG Eel Slice 60pcs 180g', '蒲烧太郎 烤鳗鱼鱼肉干 盒装60枚 180g', 7.40, '/uploads/product_1_2017_11_01_02_59_58.jpg', 0, 1, 1, '蒲烧太郎烤鳗鱼鱼肉干', 122, '2018-07-27 06:48:57', '2018-09-19 04:58:27', 59, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/1516216055.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">蒲烧太郎烤鳗鱼鱼肉干采用真鱼肉制作，</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">蒲烧是日本特有的烹饪工艺，</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">首先将鱼膏用米酒浸过，有淡淡的酒香，</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">然后加入酱油、味譄等秘制调料，最后用小火烹饪收汁。</span></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/1516216055.jpg\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 10, '磅', 'pound', '盒', 'box', 0.45, NULL, 90, NULL, NULL, NULL);
