INSERT INTO `product` VALUES (245, '4901330802851', 'Calbee Potato Farm Three Brother Fries 180g', 'Calbee 薯条三兄弟 全球薯条风味大赏 180g', 8.91, '/uploads/三兄弟正面.jpg', 0, 1, 1, '薯条三兄弟', 121, '2018-07-27 06:54:27', '2018-09-20 01:04:38', 49, '<p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/三兄弟正面.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1521837069.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1521837082.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1521837093.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">多次评选为全球最好吃的薯条，日本北海道每人限购3盒。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">精选北海道十胜寺尾农场土豆，表面松脆，内里酥嫩，刚入口有一股淡淡的奶香，再咀嚼就是马铃薯的植物香味。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">外表那层淡淡的盐粉选自鄂霍次克地区产的焙制精盐，增添了一种特别而又芳香柔和的风味。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">纯手工制作“小锅单独烘炸”，每一小锅都有专人看护和调控，为求烘炸出最合适的薯条。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">带皮切条，最大限度保留马铃薯的原味。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">打开包装，一根根薯条透着致命诱惑。吃上一把，瞬间体验咀嚼酥脆的快感，适中的咸盐味透着一点点“熏”，带出土豆浓郁的淀粉香甜味。</span></p><p></p><p></p><h5></h5><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/三兄弟正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/1521837069.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1521837082.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1521837093.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p></p>', 12, '磅', 'pound', '盒', 'box', 0.60, NULL, 90, NULL, NULL, NULL);
