INSERT INTO `product` VALUES (249, '4515061186311', 'BCL SABORINO Morning Mask 32 sheets', 'BCL SABORINO 早安60秒懒人保湿面膜 32片入', 13.20, '/uploads/zaoanmianmo 1.jpg', 9, 1, 1, '面膜', 130, '2018-07-27 07:17:18', '2018-09-19 04:42:57', 167, '<p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/zaoanmianmo%201.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/zaoanmianmo%202.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/zaoanmianmo%203.jpg\"></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">日本很有人气的BCL SABORINO早安面膜（也叫“晨间60秒懒人面膜”）。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">一包里面有32片，每天早上一片可以用一个月。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">睡醒睁开眼睛就可以敷，60秒就可以。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">包含了洁面、化妆水、乳液的功用，一片搞定节省早上的护肤时间，适合早上匆忙的人。</span></h5><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/zaoanmianmo 1.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/zaoanmianmo 2.jpg\" style=\"max-width:100%;\"><br></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">清新水果薄荷味，提神醒脑！</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">湿纸巾抽盒的包装，非常方便。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/zaoanmianmo 3.jpg\" style=\"max-width:100%;\"><br></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">牛油果和橙子的结合，适合所有肤质、混合型的（例如T区容易出油但脸颊很干）</span></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：洁面，滋润，保湿，醒肤。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></p><p></p><p></p></p>', 10, '磅', 'pound', '袋', 'bag', 0.95, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (251, '4903335695254', 'NATURIE Hatomugi Brightening Toner 500ml', 'NATURIE 薏仁美白保湿全能化妆水 500ml', 5.50, '/uploads/product_1_2018_02_19_11_36_45.jpg', 298, 1, 1, '美白化妆水薏仁水', 130, '2018-07-27 07:24:52', '2018-09-19 04:43:08', 80, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/product_1_2018_02_19_11_36_45.jpg\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">NATURIE薏仁化妆水含薏米精华与矿物质成分，滋润肌肤，清爽保湿，长期使用能使肌肤白皙润泽。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">薏米富含蛋白质、碳水化合物和人体所必需的8种氨基酸，有很好的美白功效，同时能使肌肤变得光滑、细腻。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/product_1_2018_02_19_11_36_45.jpg\" style=\"max-width:100%;\"><br></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：美白补水，收敛毛孔，晒后修复，</span></p><p data-v-331b5d4b=\"\"><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 日常喷雾---把薏仁水装在喷壶里，喷在脸上后轻轻拍打使皮肤加速吸收。</span></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 化妆棉擦拭---用化妆棉擦拭脸部，达到爽肤的功效。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">3. 化妆棉湿敷---用化妆棉湿敷在脸上，起到补水美白的功效。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">4. 压缩面膜湿敷---使用压缩面膜湿敷在脸上，自制面膜便宜又好用。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">5. 面膜纸和化妆棉混合湿敷---可以选择喜爱的不同功效的化妆水，用化妆棉沾取薏仁水敷上脸后，用另一种化妆水泡湿压缩面膜，一起敷在脸上起到双重功效。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></p><p></p><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 1.20, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (252, '4582174740686', 'SOSU Foot Peeling Mask Lavender 4pcs', 'SOSU 去死皮去角质足膜 Foot Peeling Mask 薰衣草香 4枚入', 9.68, '/uploads/footpeeling pack perorin 足贴紫.jpg', 24, 1, 1, '足膜', 127, '2018-07-27 07:36:22', '2018-09-19 04:41:26', 90, '<p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/footpeeling%20pack%20perorin%20%E8%B6%B3%E8%B4%B4%E7%B4%AB.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/footpeeling%20pack%20perorin%20%E8%B6%B3%E8%B4%B4%E7%B4%AB3.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/footpeeling%20pack%20perorin%20%E8%B6%B3%E8%B4%B4%E7%B4%AB2.jpg\"></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">夏天穿了凉鞋拖鞋，但角质层太厚、死皮太多，不好看？</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">SOSU去死皮去角质足膜含有透明质酸，神经酰胺等多种保湿成分。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">只需简单裹敷便可脱去死皮和角质，7天后脱完皮后双足光滑细嫩。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/footpeeling pack perorin 足贴紫.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/footpeeling pack perorin 足贴紫3.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">一盒有四枚足膜，可以使用两回，性价比高。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">在护理足部的同时，还有疗愈的薰衣草香。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/footpeeling pack perorin 足贴紫2.jpg\" style=\"max-width:100%;\"><br></p><h5><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 洗脚或沐浴后，将足膜用剪刀沿线剪开，保持立放以免精华液流出</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 将双脚套入足套，用附赠的胶带将开口固定住</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">3. 静待60至90分钟，让精华液充分浸透双脚</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">4. 脱掉足套，将双脚用温水冲洗干净，完成护理</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">5. 3-7天后，将会有老废角质开始脱落，脱皮属于正常现象，大概7日后完成脱皮，死皮和角质都已去除</span></h5><div><br></div><p></p><p></p><p></p><p></p></p>', 30, '磅', 'pound', '盒', 'box', 0.60, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (253, '6935284415162', 'Weilong Sour and Spicy Hot Konjac 20pcs 360g', '卫龙 魔芋爽 酸辣素毛肚 20入 360g', 2.86, '/uploads/魔芋爽绿1.jpg', 0, 1, 1, '魔芋爽', 122, '2018-07-27 07:38:16', '2018-10-06 02:39:40', 133, '<p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/魔芋爽绿1.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/酸辣绿.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/酸辣魔芋爽11.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p></p>', '<p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/魔芋爽绿1.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/酸辣绿.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/酸辣魔芋爽11.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p></p>', 18, '磅', 'pound', '盒', 'box', 1.07, NULL, 180, NULL, NULL, NULL);
INSERT INTO `product` VALUES (254, '4902702001216', 'MARUTAI Nagasaki Tonkotsu Ramen 185g', 'MARUTAI 博多豚骨汤拉面 2人份 185g', 1.87, '/uploads/博多.jpg', 450, 1, 1, '日本MARUTAI 博多豚骨汤拉面', 119, '2018-07-27 07:38:33', '2018-09-19 04:40:17', 62, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/博多.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/博多拉面 细节 1.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">博多豚骨汤拉面，还原度超高的樱花国美食。</span></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">特熬浓汤直击味蕾，非油炸面入口爽韧！</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">使用猪骨，鸡骨与洋葱熬制成汤底，加上白胡椒、芝麻粒与酱油提升烫头风味的酱包，</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">3分钟即可品尝日本专业级别拉面店的味道。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/博多.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/博多拉面 细节 3.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/博多拉面 细节 2.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/博多拉面 细节 1.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 15, '磅', 'pound', '袋', 'bag', 0.45, NULL, 240, NULL, NULL, NULL);
