0, 0); font-family: 微软雅黑;\">1. 洗脚或沐浴后，将足膜用剪刀沿线剪开，保持立放以免精华液流出</span></h5><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">2. 将双脚套入足套，用附赠的胶带将开口固定住</span></h5><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">3. 静待60至90分钟，让精华液充分浸透双脚</span></h5><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">4. 脱掉足套，将双脚用温水冲洗干净，完成护理</span></h5><h5><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">5. 3-7天后，将会有老废角质开始脱落，脱皮属于正常现象，大概7日后完成脱皮，死皮和角质都已去除</span></h5><div><br></div><p></p><p></p><p></p><p></p></p>', 30, '磅', 'pound', '盒', 'box', 0.60, NULL, 1000, NULL, NULL, NULL);
