INSERT INTO `product` VALUES (262, '4547315370603', 'MUJI Original Marshmallow 80g', 'MUJI无印良品 原味棉花糖 80g', 1.20, '/uploads/MUJI 棉花糖 1.jpg', 30, 1, 1, '无印良品 原味棉花糖 80g', 123, '2018-07-27 08:10:45', '2018-09-19 04:30:15', 33, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/product_1_2017_09_27_05_47_04.png\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/product_1_2017_09_27_05_47_25.png\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/product_1_2017_09_27_05_47_14.png\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/MUJI 棉花糖 2.jpg\" style=\"max-width: 100%;\"><br></p></p>', '<p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">无印良品的棉花糖，口感超糯，奶味香浓。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">不过干也不过甜，不喜欢吃甜食的朋友也可以接受。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><span style=\"font-weight: bold;\">想必看过《爸爸去哪儿2》的朋友都对多妈自制牛轧糖的镜头记忆犹新，</span><span style=\"font-weight: bold;\">棉花糖和花生腰果碎一起放入微波炉叮几秒，拿出来就是白花花的牛轧糖。&nbsp;</span></span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">无印良品这款棉花糖香甜软糯，非常适合做牛轧。</span><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/product_1_2017_09_27_05_47_04.png\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/product_1_2017_09_27_05_47_25.png\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/product_1_2017_09_27_05_47_14.png\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/MUJI 棉花糖 2.jpg\" style=\"max-width: 100%;\"></p><p></p></p>', 10, '磅', 'pound', '包', 'bale', 0.19, NULL, 120, NULL, NULL, NULL);
INSERT INTO `product` VALUES (263, '4560302210010', 'GEKKA Pore Contracting Sleeping Mask 80g', 'GEKKA 毛孔调理免洗睡眠面膜 80g', 18.34, '/uploads/gekka正面.jpg', 8, 1, 1, '睡眠面膜', 130, '2018-07-27 08:14:08', '2018-09-19 04:28:48', 71, '<p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/gekka%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/gekka%E4%BE%A7%E9%9D%A2.jpg\"><br></p><p style=\"text-align: center;\">、<img src=\"http://buy.yn-pulse.com/uploads/gekka%E9%87%8C%E9%9D%A2.jpg\"></p><p></p></p>', '<p><p></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">GEKKA毛孔调理免洗睡眠面膜是一款多效合一的面膜，可以在夜间修复肌肤。</span></p><p></p><p></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">连整形美容院的院长三枝静香都曾惊叹，跟美容院使用毛孔镭射修复仪一样的效果！<br></span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">含有37种成分、17种活性成分，能够促进细胞新陈代谢及细胞再生，舒缓与振奋精神，让肌肤在睡眠时间得到更好的恢复。改善肌肤的干燥问题，消除黑头，紧致肌肤。</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">还有最重要的，缩小毛孔，改善肤质！</span></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/gekka正面.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/gekka侧面.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">睡前涂抹一层 = 四效合一（化妆水+收毛孔精华+乳液+面霜）</span></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/gekka里面.jpg\" style=\"max-width: 100%;\"></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">功效：调整角质层，镇痘，深层清洁毛孔中的皮脂，消除黑头，缩小毛孔，改善肤质，保湿补水，紧致肌肤。</span></p><p></p><p></p><p style=\"text-align: left;\"><u style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">用法</u></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">1. 睡前清洗面部。可涂抹轻薄的化妆水或依不同肤质可涂抹乳液。</span></p><p style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">2. 取适量睡眠面膜均匀涂抹。（2~3cm的量）</span></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">3. 轻微拍打或按摩至吸收。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">4. 免洗即可睡觉。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\"><br></span></p></p>', 10, '磅', 'pound', '瓶', 'bottle', 0.35, NULL, 1000, NULL, NULL, NULL);
