INSERT INTO `product` VALUES (266, '4975729200900', 'ASHIRIRA Detox Foot Patch Wormwood 30pcs', '树之惠 天然树液艾草排毒足贴 Foot Patch 30枚入', 11.00, '/uploads/绿足贴 艾草 1.jpg', 50, 1, 1, '排毒足贴', 127, '2018-07-27 08:41:14', '2018-09-19 04:23:16', 85, '<p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E7%BB%BF%E8%B6%B3%E8%B4%B4%20%E8%89%BE%E8%8D%89%201.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E7%BB%BF%E8%B6%B3%E8%B4%B4%20%E8%89%BE%E8%8D%89%202.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E7%BB%BF%E8%B6%B3%E8%B4%B4%20%E8%89%BE%E8%8D%89%203.jpg\"></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">树之惠的排毒足贴含有天然树液和多种植物提取成分，能把身体的毒素从穴位中吸出来。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">使用足贴进行排毒，可以减轻淋巴系统的负担，并可以帮助改善淋巴系统和相关的血液系统的循环。足贴可以加强血液循环，加速新陈代谢，提高睡眠质量，排出体内毒素，从而改善人体内部的动态平衡，使人更加健康。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/绿足贴 艾草 1.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/绿足贴 艾草 2.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">艾草排毒足贴适合所有人士使用。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：祛湿，抗干燥，理气血，疏通经络</span></h5><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/绿足贴 艾草 3.jpg\" style=\"max-width:100%;\"><br></p><h5><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 晚上睡前贴上，早上撕下即可。（可贴于足底，也可以贴在腰、颈、背、头、手心等位置）</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 先撕下白色胶贴纸，把足贴包贴放在中央部，然后贴在脚心部，使用后洗净或用湿毛巾擦拭干净。</span></h5><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></div><p></p><p></p><p></p><p></p><p></p></p>', 48, '磅', 'pound', '盒', 'box', 0.62, NULL, 1000, NULL, NULL, NULL);
