INSERT INTO `product` VALUES (284, '4942723275166', 'TOKYO AN-PUDDING 8pcs 400g', '东京布丁 8枚入 400g', 9.00, '/uploads/product_1_2018_03_02_19_49_59.jpg', 20, 1, 1, '东京布丁', 123, '2018-07-31 01:49:27', '2018-09-19 03:08:32', 83, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/product_1_2018_03_02_19_50_08.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1520048970.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1520048960.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1520048950.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">花园万头创立于1834年，是日式糕点届的百年老字号，</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">其主打产品东京红豆布丁采用北海道特产红豆搭配不甜腻的卡仕达鸡蛋布丁，</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">吃起来有着浓郁却又不会抢味的红豆味道，</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">颠覆对传统布丁的印象。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">贴心的8个独立包装搭配纸质勺子，环保又精致。</span></p><p></p><p></p><p></p><p></p><h5></h5><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/product_1_2018_03_02_19_50_08.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1520048970.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1520048960.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/1520048950.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 40, '磅', 'pound', '盒', 'box', 0.90, NULL, 365, NULL, NULL, NULL);
INSERT INTO `product` VALUES (285, '6970378822235', 'KaiXiaoChai Caramel Popcorn 112g', '开小差 焦糖爆米花 112g', 1.22, '/uploads/开小差焦糖.jpg', 500, 1, 1, '开小差 焦糖爆米花 112g', 121, '2018-07-31 02:04:16', '2018-09-11 03:02:32', 135, '<p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/开小差奶油.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/开小差焦糖细节1.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/开小差焦糖细节2.jpg\" style=\"max-width:100%;\"><br></p><p><br></p><p></p><p></p></p>', '<p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small;\">放空自己 让心情开会小差。&nbsp;</span></p><p><span style=\"font-weight: bold; font-size: small;\">合理把握每一步，骤给予爆米花别致香味。</span></p><p><span style=\"font-weight: bold; font-size: small;\">严苛糖分比例，香甜酥脆不粘腻，颗颗均匀包裹，拒绝素然无味。&nbsp;</span></p><p><span style=\"font-weight: bold; font-size: small;\">选用鲜嫩美味的玉米作为原材料，原料粒粒金黄色泽，水分饱满，</span></p><p><span style=\"font-weight: bold; font-size: small;\">一颗颗金灿灿的小球看得见的香脆美味。</span></p><p><span style=\"font-weight: bold; font-size: small;\">酥酥松脆的爆米花，色泽金黄。每一口都与甜蜜相遇。</span></p><p><span style=\"font-weight: bold; font-size: small;\">一部好看的电影，一份小零食，让生活变得多姿多彩。</span></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/开小差焦糖.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/开小差焦糖细节1.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/开小差焦糖细节2.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p></p>', 30, '磅', 'pound', '盒', 'box', 0.44, NULL, 270, NULL, NULL, NULL);
