INSERT INTO `product` VALUES (292, '4902750697522', 'UHA High Concentrated Milk Hard Candy 105g', 'UHA 味觉糖 北海道特浓牛奶糖 105g', 1.88, '/uploads/牛奶糖正面.jpg', 100, 1, 1, 'UHA 味觉糖 北海道特浓牛奶糖 105g', 123, '2018-07-31 04:11:45', '2018-09-19 03:06:50', 51, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/牛奶糖里面2.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/牛奶糖里面.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">UHA家的主打产品，日本牛奶糖界绝对的super star。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">上等北海道牛奶制作，</span><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">只要1颗就可以体会到上等牛奶的醇，香，浓，滑。</span></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">传说中6颗可以冲1杯牛奶哦！</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">UHA悠哈特浓牛奶糖的熔点很低，极易被消化吸收。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">一般的牛奶中约含3.4%的乳脂肪，而这款产品则含有8.2%的乳脂肪。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">不仅营养成分高，而且还具有更加香浓的口味。</span></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/牛奶糖里面2.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/牛奶糖里面.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 72, '磅', 'pound', '包', 'bale', 0.23, NULL, 365, NULL, NULL, NULL);
