INSERT INTO `product` VALUES (296, '4901360285587', 'Bourbon Soymilk Cookie Low Calorie 100g', 'Bourbon布尔本 豆乳威化低卡饼干 100g', 2.30, '/uploads/豆乳威化正面.jpg', 10, 1, 1, '布尔本豆乳威化低脂饼干', 125, '2018-07-31 04:36:30', '2018-09-19 03:06:20', 124, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/640.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/640-1.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/e574deab3a3c4c7ab26eeac23642307c.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/49720c25d91f5297e825fc1ddce0cda4.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">布尔本豆乳味的威化饼干，有豆乳的醇香，两块威化独立小包装，只有80kcal，热量非常低。<br></span></p><p></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">豆乳饼干是属于那种好吃不腻的那种。口感清淡不甜腻，散发出烘焙后的黄豆和小麦粉自然的清香。</span></p><p></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">低脂低热量。一小袋2枚入威化饼含5mg有益大豆异黄酮，而且热量只有80Kcal。</span></p><p><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">豆乳含有丰富的营养成分，特别蛋白质、镁，此外还含有维生素B1、B2等，是很好的营养食品。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/640.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/640-1.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/e574deab3a3c4c7ab26eeac23642307c.jpg\" style=\"max-width: 100%;\"><img src=\"http://buy.yn-pulse.com/uploads/49720c25d91f5297e825fc1ddce0cda4.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', 24, '磅', 'pound', '包', 'bale', 0.29, NULL, 240, NULL, NULL, NULL);
