INSERT INTO `product` VALUES (301, '655222757814', 'YOKU MOKU Handmade Rolled Cigares 20 sticks', 'YOKU MOKU 手工雪茄蛋卷 20条入', 16.58, '/uploads/蛋卷 正面.jpg', 0, 1, 1, 'YOKO MOKU 手工蛋卷', 125, '2018-07-31 06:01:27', '2018-09-20 01:03:27', 129, '<p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/里面蛋卷2.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/蛋卷里面.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">YOKU MOKU手工雪茄蛋卷，材料选取北海道牛油及日本高级白砂糖将添加足量牛油的饼糊进行烘烤，然后卷成雪茄烟卷状精制而成，具有浓厚的风味以及松脆的口感，入口绵密，奶油味十足。</span></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">YOKU MOKU推出的产品有Cigare雪茄蛋卷、曲奇和什锦礼盒。其中因为长得像雪茄的手工蛋卷是最具人气的王牌产品。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/里面蛋卷2.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/蛋卷里面.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', 30, '磅', 'pound', '盒', 'box', 1.13, NULL, 120, NULL, NULL, NULL);
INSERT INTO `product` VALUES (302, '4901777301092', 'Natchan! Apple Juice 425ml', 'Natchan!小奈 苹果味果汁 425ml', 1.54, '/uploads/小奈果汁 苹果1.jpg', 10, 1, 1, '小奈果汁苹果味', 118, '2018-07-31 06:20:39', '2018-09-19 03:04:07', 130, '<p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/小奈果汁 苹果1.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/小奈果汁 苹果2.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">&nbsp;富含苹果汁的小奈苹果味苏打果汁，具有苹果的自然甘甜口味。<br></span></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">&nbsp;喝起来清爽畅快的气泡口感，在日本是深受大人小孩喜爱的气泡饮料。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">因为是手摘苹果，所以是在苹果熟度刚刚好时，精挑品质最好的摘取下来，增生不少新鲜感和美味。&nbsp;&nbsp;</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">注重健康又怕负担，不使用色素及防腐剂的，完整呈现果实的天然风味，清爽新鲜又自然。&nbsp;&nbsp;</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/小奈果汁 苹果1.jpg\" style=\"max-width:100%;\"><img src=\"http://buy.yn-pulse.com/uploads/小奈果汁 苹果2.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p><p></p><p></p></p>', 24, '磅', 'pound', '瓶', 'bottle', 1.03, NULL, 180, NULL, NULL, NULL);
