INSERT INTO `product` VALUES (317, '4961989409115', 'pdc Sake Whitening Facial Mask 10 sheets', 'pdc 酒粕面膜亮白嫩肤 10片入', 19.15, '/uploads/酒糟面膜 1.jpg', 200, 1, 1, '范冰冰同款', 130, '2018-08-01 02:27:19', '2018-09-20 01:13:56', 67, '<p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E9%85%92%E7%B3%9F%E9%9D%A2%E8%86%9C%201.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E9%85%92%E7%B3%9F%E9%9D%A2%E8%86%9C%202.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">pdc是POLA旗下的平价品牌。<br></span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">这款pdc酒粕面膜出自Wafood Made系列，采用的是熊本的纯酒粕，精华成分中还加入了黄瓜萃取、柚子萃取、大米萃取等天然成分，对肌肤非常温和。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">被钻研美白多年的范冰冰认可的美白面膜，哪里都非常难买到的酒粕面膜。</span></h5><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/酒糟面膜 1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/酒糟面膜 2.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">酒粕是日本酒原料发酵后的酒糟，含有大量酵母、曲酸。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：亮白嫩肤，提亮肤色，祛黄，淡化痘印、斑点，保湿。</span></h5><div><br></div><p></p><p></p></p>', 20, '磅', 'pound', '盒', 'box', 0.37, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (318, '4901616011014', 'SUNSTAR Ora2 Stain Clear Peach Mint Flavor 130g', 'SUNSTAR Ora2皓乐齿 亮白净色牙膏 蜜桃薄荷味 130g', 3.04, '/uploads/Ora2 皓乐齿蜜桃薄荷.jpg', 200, 1, 1, '皓乐齿牙膏', 126, '2018-08-01 05:10:34', '2018-09-20 01:13:48', 128, '<p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/Ora2%20%E7%9A%93%E4%B9%90%E9%BD%BF%E8%9C%9C%E6%A1%83%E8%96%84%E8%8D%B7.jpg\"><br></p><p></p><p></p><p></p><p></p></p>', '<p><p><span style=\"font-family: 微软雅黑; font-size: small; color: rgb(0, 0, 0); font-weight: bold;\">Ora2皓乐齿亮白净色牙膏拯救早上不想刷牙的你！</span></p><p></p><p></p><p></p><h5></h5><p></p><h5><span style=\"font-family: 微软雅黑; font-size: small; color: rgb(0, 0, 0); font-weight: bold;\">去除牙渍美化牙齿，可去除因茶、咖啡、抽烟等造成的牙渍，<br></span></h5><p></p><p><span style=\"font-family: 微软雅黑; font-size: small; color: rgb(0, 0, 0); font-weight: bold;\">恢复牙齿原本亮白颜色，使你拥有一口健康亮丽的牙齿。</span></p><p><span style=\"font-family: 微软雅黑; font-size: small; color: rgb(0, 0, 0); font-weight: bold;\">独特的牙渍控制配方，让牙渍更难附着在牙齿表面，常保牙齿洁白亮丽。</span></p><p></p><h5><span style=\"font-family: 微软雅黑; font-size: small; color: rgb(0, 0, 0); font-weight: bold;\">带有甜甜的蜜桃香和清新的薄荷香，日本女性最爱牙膏第一名。</span><br><br></h5><p><img src=\"http://buy.yn-pulse.com/uploads/Ora2 皓乐齿蜜桃薄荷.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p></p>', 10, '磅', 'pound', '只', 'piece', 0.31, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (319, '4973167158425', 'KANEBO Freeplus Gentle Cleansing Cream 100g', 'KANEBO Freeplus 氨基酸洗面奶 100g', 16.00, '/uploads/freeplus mild soap1.jpg', 5, 1, 1, '氨基酸洗面', 130, '2018-08-01 05:19:30', '2018-09-19 02:58:12', 127, '<p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/freeplus%20mild%20soap1.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/freeplus%20mild%20soap3.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/freeplus%20mild%20soap2.jpg\"></p><p></p></p>', '<p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">Freeplus的含义指“无添加”，即低刺激的呵护敏感肌肤。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">不含防腐剂、香料、紫外线吸收剂、色素、酒精、和矿物油。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">由6种植物混合，无香料，无着色（色素），弱酸性。</span></h5><p><img src=\"http://buy.yn-pulse.com/uploads/freeplus mild soap1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/freeplus mild soap3.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">氨基酸洗面奶可以温和的深层清洁毛孔内部的垃圾。</span></h5><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">使用过后不仅皮肤不紧绷，还很水润。</span></h5><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/freeplus mild soap2.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">我们的肌肤表面呈现弱酸性，氨基酸洗面奶的弱酸性与皮肤PH值接近，用起来亲肤温和，低刺激，用后无残留，对肌肤没有伤害。</span></h5><div><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></div><p></p></p>', 10, '磅', 'pound', '只', 'piece', 0.29, NULL, 1000, NULL, NULL, NULL);
