INSERT INTO `product` VALUES (322, '4901872521807', 'SHISEIDO Revital Wrinklelift AA Eye Cream 15g', '资生堂 Revital抗皱眼霜 15g', 77.00, '/uploads/资生堂 抗皱眼霜 1.jpg', 0, 1, 1, '资生堂抗皱眼霜', 130, '2018-08-01 06:00:35', '2018-09-29 01:21:04', 31, '<p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E8%B5%84%E7%94%9F%E5%A0%82%20%E6%8A%97%E7%9A%B1%E7%9C%BC%E9%9C%9C%201.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E8%B5%84%E7%94%9F%E5%A0%82%20%E6%8A%97%E7%9A%B1%E7%9C%BC%E9%9C%9C%202.jpg\"></p><p></p></p>', '<p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">资生堂里大名鼎鼎的“小熨斗”眼霜！</span></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">Revital抗皱眼霜是一款可以积极改善局部皱纹（眼部细纹、干纹、皱纹、法令纹、）的高机能美容液精华眼霜。</span><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/资生堂 抗皱眼霜 1.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">含有高纯度的维他命A和抑制黑色素生成的4MSK，去皱抗老的功效更强。</span></h5><p><img src=\"http://buy.yn-pulse.com/uploads/资生堂 抗皱眼霜 2.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：去黑眼圈，消除眼袋，淡化细纹，抗皱，滋养皮肤</span></p><p></p><p></p><p><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 因为眼霜里含有活性维他命A，所以建议晚上的时候使用。<u><br></u></span></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 在整个脸部护肤完成后，局部涂在眼睛周围，适用与护肤最后一步。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></p></p>', 10, '磅', 'pound', '盒', 'box', 0.08, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (323, '4548076450450', 'MUJI Gel Cleansing Big Volume 200g', 'MUJI无印良品 卸妆啫喱 大容量 200g', 7.70, '/uploads/MUJI 卸妆啫喱 大容量.jpg', 20, 1, 1, 'MUJI无印良品卸妆', 130, '2018-08-01 08:31:58', '2018-09-19 02:56:44', 33, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/MUJI%20%E5%8D%B8%E5%A6%86%E5%95%AB%E5%96%B1%20%E5%A4%A7%E5%AE%B9%E9%87%8F.jpg\"><br></p></p>', '<p><p></p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">MUJI无印良品主打的就是温和无添加。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">无香料！无色素！无矿物油！弱酸性！无酒精！</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">无印良品的这款卸妆啫喱是完全无油的清爽啫喱质地，卸妆能力跟卸妆油一样好。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">（贴心提醒，眼唇还是得用专门的眼唇卸妆液的）</span></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">带有淡淡的柚子香味，添加了天然的柚子精油。</span></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/MUJI 卸妆啫喱 大容量.jpg\" style=\"max-width:100%;\"><br></p><p><u style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</u></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 取适量卸妆啫喱（约3cm）在脸部以螺旋状涂抹开与彩妆和污垢充分融合。</span></p><p></p><p></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 用温水和洗面奶充分冲洗。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></p></p>', 12, '磅', 'pound', '瓶', 'bottle', 0.50, NULL, 1000, NULL, NULL, NULL);
