INSERT INTO `product` VALUES (339, '4973167185728', 'KANEBO Suisai Beauty Clear Powder Pore Cleansing 32pcs', 'KANEBO Suisai 酵素洗颜粉 去黑头粉刺 32枚入', 16.50, '/uploads/suisai酵素洗颜 1.jpg', 0, 1, 1, '酵素洗颜粉', 130, '2018-08-03 02:23:57', '2018-09-29 01:20:48', 127, '<p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/suisai%E9%85%B5%E7%B4%A0%E6%B4%97%E9%A2%9C%201.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/suisai%E9%85%B5%E7%B4%A0%E6%B4%97%E9%A2%9C%202.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/suisai%E9%85%B5%E7%B4%A0%E6%B4%97%E9%A2%9C%203.jpg\"></p><p></p></p>', '<p><p></p><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">KANEBO Suisai酵素洗颜粉是一款有效去除黑头角质清洁毛孔的洗颜粉。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">含有两种酵母成分能将陈旧角质和过剩皮脂分解，深层清洁毛孔，可去除黑头，角质，改善皮肤暗沉粗糙，毛孔粗大，粉刺的情况。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">洗后干燥不紧绷且光滑，坚持使用对毛孔黑头有很大改善。</span></h5><p><img src=\"http://buy.yn-pulse.com/uploads/suisai酵素洗颜 1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/suisai酵素洗颜 2.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">一盒里面总共有32粒，一粒打开可以使用2至3次。因为清洁力度强大，建议最多一周使用一次、最少一个月使用一次。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">无刺激，无香味，使用方便且易携带。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">适合T区出油，干燥肌，痘痘肌。</span></h5><p><img src=\"http://buy.yn-pulse.com/uploads/suisai酵素洗颜 3.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">功效：提亮肤色，保湿，去黑头粉刺，改善皮肤暗沉粗糙、毛孔粗大、痘痘，清洁皮肤。</span></h5><h5><u style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">用法</u></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">1. 用温水浸湿脸，取适量洗颜粉倒在手上或起泡网上。<u><br></u></span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">2. 加上少量水搓出泡沫后，用泡沫来按摩全脸，大约按摩3分钟。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">3. 以温水冲洗干净。</span></h5><div><br></div><p></p></p>', 60, '磅', 'pound', '盒', 'box', 0.11, NULL, 1000, NULL, NULL, NULL);
