INSERT INTO `product` VALUES (347, '4961503571809', 'MOLTO BENE Loretta Rose Base Care Oil 120ml', 'MOLTO BENE Loretta玫瑰烫染修护发油 120ml', 21.90, '/uploads/loretta base care oil.jpg', 0, 1, 1, '范冰冰发油', 128, '2018-08-04 02:18:32', '2018-09-29 01:20:10', 172, '<p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/loretta%20base%20care%20oil.jpg\"><br></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/loretta%20base%20care%20oil1.jpg\"></p><p></p></p>', '<p><p></p><p></p><p></p><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">若隐若现的淡淡玫瑰香气，抹完就像在头发里喷了香水一样的Loretta发油。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">含有大马士革玫瑰（精华滋养，给予头发充分养护），天竺葵（保湿修复受损发质），薰衣草（促进细胞再生，平衡皮脂分泌），蔷薇花。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">质地流动性高，不黏腻，滋润但一点都不油腻。</span></h5><p><img src=\"http://buy.yn-pulse.com/uploads/loretta base care oil.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/loretta base care oil1.jpg\" style=\"max-width:100%;\"></p><p><u style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">用法</u></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">1. 湿发：将头发洗净后，在头发半干时挤适量涂在发尾，吹干。<br></span></p><p></p><p></p><p data-v-331b5d4b=\"\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">2. 干发：头发干枯时、或者卷发前，将头发梳顺，适量涂上。</span></p><p data-v-331b5d4b=\"\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><br></span></p><p></p></p>', 10, '磅', 'pound', '瓶', 'bottle', 0.35, NULL, 1000, NULL, NULL, NULL);
