INSERT INTO `product` VALUES (349, '4987241145423', 'RHOTO Skin Aqua SARAFIT UV Lotion SPF50+ PA++++ 80g', 'RHOTO乐敦 水感保湿防晒乳液 SPF50+ PA++++ 80g', 5.40, '/uploads/Rhoto防晒 1.jpg', 10, 1, 1, 'RHOTO乐敦防晒', 127, '2018-08-04 02:49:48', '2018-09-29 01:19:55', 50, '<p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/Rhoto%E9%98%B2%E6%99%92%201.jpg\"><br></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/Rhoto%E9%98%B2%E6%99%92%202.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">清薄，瞬间吸收的乐敦水感保湿防晒乳液。<br></span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">涂上后的肌肤透白清爽，像皮肤一样贴合的高系数防晒乳液。</span></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/Rhoto防晒 1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/Rhoto防晒 2.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">SPF50+ PA++++&nbsp;适合日常短时间通勤的防晒，也适合长时间外出曝晒。</span></h5><div><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><br></span></div><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 0.25, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (350, '4901301276186', 'NIVEA Super UV Water Gel SPF50 PA+++ 80g', 'NIVEA妮维雅 水感清爽防晒啫喱 SPF50 PA+++ 80g', 6.93, '/uploads/Nivea防晒 1.jpg', 10, 1, 1, 'NIVEA妮维雅防晒', 127, '2018-08-04 02:57:26', '2018-09-29 01:19:55', 174, '<p><p></p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/Nivea%E9%98%B2%E6%99%92%201.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/Nivea%E9%98%B2%E6%99%92%202.jpg\"></p><p></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p></p><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">质感像化妆水一样的妮维雅水感防晒啫喱，水润不油腻，轻薄却很防晒！</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">无香料无添加，温和不刺激，脸和身体都适用。</span></h5><p><img src=\"http://buy.yn-pulse.com/uploads/Nivea防晒 1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/Nivea防晒 2.jpg\" style=\"max-width:100%;\"><br></p><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">SPF50 PA+++ 适合日常短时间通勤的防晒。</span></h5><div><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><br></span></div><p></p><p></p><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 0.24, NULL, 1000, NULL, NULL, NULL);
