INSERT INTO `product` VALUES (389, '6924743918610', 'LAY\'S Potato Chips Grilled Squid Flavor 70g', 'LAY\'S乐事 大波浪薯片 铁板鱿鱼味 70g', 0.90, '/uploads/大波浪 铁板鱿鱼味.jpg', 40, 1, 1, '乐事薯片', 121, '2018-08-07 01:44:26', '2018-08-25 02:30:16', 141, '<p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E5%A4%A7%E6%B3%A2%E6%B5%AA%20%E9%93%81%E6%9D%BF%E9%B1%BF%E9%B1%BC%E5%91%B3.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/709a9472b87086435a01dc701d6eec81_0x0.jpg\"></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p style=\"text-align: center;\">颜色鲜艳，口味上相对要重一点，</p><p style=\"text-align: center;\">但是脆度也略胜一筹！</p><p style=\"text-align: center;\">调味粉撒的多，</p><p style=\"text-align: center;\">所以不用去挑选，</p><p style=\"text-align: center;\">味道重也能接受的感觉！<br></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/大波浪 铁板鱿鱼味.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/709a9472b87086435a01dc701d6eec81_0x0.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', 22, '磅', 'pound', '包', 'bale', 0.20, NULL, 270, NULL, NULL, NULL);
INSERT INTO `product` VALUES (390, '6924743919808', 'LAY\'S Potato Chips Hot Spicy Flavor 70g', 'LAY\'S乐事 大波浪薯片 辛辣味 70g', 0.90, '/uploads/大波浪 辛辣味.jpg', 40, 1, 1, '乐事薯片', 121, '2018-08-07 01:50:07', '2018-08-25 02:30:16', 141, '<p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E5%A4%A7%E6%B3%A2%E6%B5%AA%20%E8%BE%9B%E8%BE%A3%E5%91%B3.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/709a9472b87086435a01dc701d6eec81_0x0.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><p style=\"text-align: center;\">嗜辣的这款就是为你准备，</p><p style=\"text-align: center;\">一打开辣椒粉的辛辣味扑面而来，</p><p style=\"text-align: center;\">味道很重，</p><p style=\"text-align: center;\">真的就是洒满辣椒面的薯片！<br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/大波浪 辛辣味.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/709a9472b87086435a01dc701d6eec81_0x0.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p></p>', 22, '磅', 'pound', '包', 'bale', 0.20, NULL, 270, NULL, NULL, NULL);
INSERT INTO `product` VALUES (391, '6924743918658', 'LAY\'S Potato Chips Roasted Chicken Wing Flavor 70g', 'LAY\'S乐事 大波浪薯片 香脆烤鸡翅味 70g', 0.90, '/uploads/大波浪 香脆烤鸡翅味.jpg', 40, 1, 1, '乐事薯片', 121, '2018-08-07 01:53:12', '2018-08-25 02:30:16', 141, '<p><p></p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E5%A4%A7%E6%B3%A2%E6%B5%AA%20%E9%A6%99%E8%84%86%E7%83%A4%E9%B8%A1%E7%BF%85%E5%91%B3.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/709a9472b87086435a01dc701d6eec81_0x0.jpg\"></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p style=\"text-align: center;\">有明显的鸡肉味，</p><p style=\"text-align: center;\">最突出的是硬度，咬起来嘎嘣脆！</p><p style=\"text-align: center;\">第一口绝对是沦陷，根本停不下来！<br></p><p style=\"text-align: center;\">烤鸡翅是咸中带点甜，不会感到咸，</p><p style=\"text-align: center;\">甜咸党应该会更喜欢！<br></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/大波浪 香脆烤鸡翅味.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/709a9472b87086435a01dc701d6eec81_0x0.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p></p>', 22, '磅', 'pound', '包', 'bale', 0.20, NULL, 270, NULL, NULL, NULL);
INSERT INTO `product` VALUES (392, '6924743919211', 'LAY\'S Potato Chips American Classic Flavor 80g', 'LAY\'S乐事 薯片 美国经典原味 80g', 0.90, '/uploads/原味.jpg', 40, 1, 1, '乐事薯片', 121, '2018-08-07 02:13:35', '2018-08-25 02:30:16', 141, '<p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E5%8E%9F%E5%91%B3.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/lays%20%E5%8E%9F%E5%91%B3.jpg\"></p><p></p></p>', '<p><p></p><p>保留纯真的土豆味道，散发原汁原味的香气。</p><p>咸香与酥松在心中缠绕。</p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/原味.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays 原味.jpg\" style=\"max-width:100%;\"><br></p><p></p></p>', 22, '磅', 'pound', '包', 'bale', 0.20, NULL, 270, NULL, NULL, NULL);
INSERT INTO `product` VALUES (393, '6924743919228', 'LAY\'S Potato Chips Texas Grilled BBQ Flavor 80g', 'LAY\'S乐事 薯片 得克萨斯烧烤味 80g', 0.90, '/uploads/得克萨斯烧烤味.jpg', 40, 1, 1, '乐事薯片', 121, '2018-08-07 02:16:39', '2018-08-25 02:30:16', 141, '<p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E5%BE%97%E5%85%8B%E8%90%A8%E6%96%AF%E7%83%A7%E7%83%A4%E5%91%B3.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays%20%E5%BE%97%E5%85%8B%E8%90%A8%E6%96%AF.jpg\"></p></p>', '<p><p><img src=\"http://buy.yn-pulse.com/uploads/得克萨斯烧烤味.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/lays 得克萨斯.jpg\" style=\"max-width:100%;\"><br></p></p>', 22, '磅', 'pound', '包', 'bale', 0.20, NULL, 270, NULL, NULL, NULL);
INSERT INTO `product` VALUES (394, '6924743919235', 'LAY\'S Potato Chips Italian Red Meat Flavor 80g', 'LAY\'S乐事 薯片 意大利香浓红烩味 80g', 0.90, '/uploads/意大利香浓红烩味.jpg', 40, 1, 1, '乐事薯片', 121, '2018-08-07 02:20:17', '2018-08-25 02:30:16', 141, '<p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E6%84%8F%E5%A4%A7%E5%88%A9%E9%A6%99%E6%B5%93%E7%BA%A2%E7%83%A9%E5%91%B3.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays%20%E8%82%89%E9%85%B1.jpg\"></p><p></p></p>', '<p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/意大利香浓红烩味.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays 肉酱.jpg\" style=\"max-width:100%;\"><br></p><p></p></p>', 22, '磅', 'pound', '包', 'bale', 0.20, NULL, 270, NULL, NULL, NULL);
INSERT INTO `product` VALUES (395, '6924743919266', 'LAY\'S Potato Chips Lime Flavor 80g', 'LAY\'S乐事 薯片 青柠味 80g', 0.90, '/uploads/青柠味.jpg', 40, 1, 1, '乐事薯片', 121, '2018-08-07 02:22:50', '2018-08-25 02:30:16', 141, '<p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E9%9D%92%E6%9F%A0%E5%91%B3.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays%20%E9%9D%92%E6%9F%A0.jpg\"></p><p></p></p>', '<p><p></p><p>除了青柠的淡淡酸味和薯片共有的咸味之外，还有一点甜甜的味道。</p><p></p><p>整体感觉上，比起青柠这种水果来，更像<b>Lemonade</b>的味道。</p><p>酸酸甜甜，一口气吃十包没问题！</p><p></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/青柠味.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays 青柠.jpg\" style=\"max-width:100%;\"><br></p><p></p></p>', 22, '磅', 'pound', '包', 'bale', 0.20, NULL, 270, NULL, NULL, NULL);
INSERT INTO `product` VALUES (396, '6924743919259', 'LAY‘S Potato Chips Cucumber Flavor 80g', 'LAY\'S乐事 薯片 黄瓜味 80g', 0.90, '/uploads/黄瓜味.jpg', 40, 1, 1, '乐事薯片', 121, '2018-08-07 02:25:38', '2018-08-25 02:30:16', 141, '<p><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E9%BB%84%E7%93%9C%E5%91%B3.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays%20%E9%BB%84%E7%93%9C.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><p style=\"text-align: center;\">清新黄瓜味是小时候第一次吃薯片的味道，</p><p style=\"text-align: center;\">口感清新，打开包装就有黄瓜的香气味，</p><p style=\"text-align: center;\">吃起来清爽带点凉凉的感觉！</p><p style=\"text-align: center;\">黄瓜味的薯片经典但是一直很受欢迎，</p><p style=\"text-align: center;\">偏清淡却适合大多数人的口味！<br></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/黄瓜味.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays 黄瓜.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p></p>', 22, '磅', 'pound', '包', 'bale', 0.20, NULL, 270, NULL, NULL, NULL);
INSERT INTO `product` VALUES (397, '6924743919297', 'LAY\'S Potato Chips Seaweed Flavor 80g', 'LAY\'S乐事 薯片 岩烧海苔味 80g', 0.90, '/uploads/岩烧海苔味.jpg', 40, 1, 1, '乐事薯片', 121, '2018-08-07 02:27:53', '2018-08-25 02:30:16', 141, '<p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/%E5%B2%A9%E7%83%A7%E6%B5%B7%E8%8B%94%E5%91%B3.jpg\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays%20%E6%B5%B7%E8%8B%94.jpg\"></p><p></p></p>', '<p><p></p><p style=\"text-align: center;\">海苔味很重也很明显，洒满海苔屑，</p><p style=\"text-align: center;\">在乐事经典款中算是比较厚的！</p><p style=\"text-align: center;\">五星推荐这款海苔味的薯片，</p><p style=\"text-align: center;\">让薯片的口感更加丰富有层次！<br></p><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/岩烧海苔味.jpg\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/lays 海苔.jpg\" style=\"max-width:100%;\"><br></p><p></p></p>', 22, '磅', 'pound', '包', 'bale', 0.20, NULL, 270, NULL, NULL, NULL);
