INSERT INTO `product` VALUES (408, '4901872073900', 'SHISEIDO Anessa Perfect UV Sunscreen Skincare Milk SPF50+ PA++++ 90ml', '资生堂 Anessa安耐晒 超防水防晒霜 金瓶 SPF50+ PA++++ 90ml', 33.62, '/uploads/anessa blue.jpg', 0, 1, 1, '安耐晒', 127, '2018-08-16 00:58:25', '2018-09-29 01:18:48', 31, '<p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/anessa%20blue.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/anessa%20blue1.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><h5><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">安耐晒可谓是防晒界的王牌，连续14年日本人气冠军防晒品牌，凭借着超前技术和无数消费者口碑，已成为大众心目中NO.1的防晒品牌。</span></h5><p><img src=\"http://buy.yn-pulse.com/uploads/anessa blue.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/anessa blue1.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-size: small; font-family: 微软雅黑; font-weight: bold; color: rgb(0, 0, 0);\">安耐晒金瓶有50%是护肤成分。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; font-weight: bold; color: rgb(0, 0, 0);\">金瓶不粘不油，酒精成分比较高，耐受皮肤或偏油皮肤可以上脸。（敏感皮肤或偏干皮肤想要上脸的话最好是用粉金瓶）</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; font-weight: bold; color: rgb(0, 0, 0);\">成膜后是哑光感的，超级防水，适合长时间外出，上山下海。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; font-weight: bold; color: rgb(0, 0, 0);\">2018年新升级后，质地比之前水润很多，几乎没有油膜感。</span></p><p></p><p></p><p></p><p></p><p></p><p></p><ul><li><span style=\"font-size: small; font-family: 微软雅黑; font-weight: bold; color: rgb(0, 0, 0);\">防晒指数：SPF50+&nbsp;，PA++++<br></span></li><li><p><span style=\"font-size: small; font-family: 微软雅黑; font-weight: bold; color: rgb(0, 0, 0);\">适用部位：脸上&nbsp;/身上可用（敏感肌不建议上脸）</span></p></li><li><p><span style=\"font-size: small; font-family: 微软雅黑; font-weight: bold; color: rgb(0, 0, 0);\">质地：水乳状（用前需摇），流动性非常好，好涂抹开，不泛白</span></p></li></ul><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 0.30, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (409, '4524734500583', 'DR.CI:LABO Labo Labo Super-Keana Lotion 100ml', 'DR.CI:LABO城野医生 Labo Labo 零毛孔化妆水 100ml', 9.83, '/uploads/1805f1b6afd48c6685dc76b69b10bde0_500x500.png', 0, 1, 1, '城野医生化妆水', 130, '2018-08-16 02:14:21', '2018-09-26 07:38:41', 100, '<p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/1805f1b6afd48c6685dc76b69b10bde0_500x500.png\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/6b73d7ae404b98cdbee45a7cd4265c6f_500x500.png\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/aa7e2763bc63d1e182b2274dd7157024_500x500.png\"></p><p></p></p>', '<p><p></p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">DR.CI:LABO城野医生是日本出名的医学美容品牌。</span></h5><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; color: rgb(0, 0, 0); font-family: 微软雅黑;\">这款城野医生Labo Labo零毛孔化妆水可谓是“毛孔收缩神器”。</span></h5><p></p><p></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/1805f1b6afd48c6685dc76b69b10bde0_500x500.png\" style=\"max-width:100%;\"><br></p><h5 style=\"text-align: left;\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">可用来湿敷（配合省水化妆棉），也可用来当作二次清洁的产品（配合去黑头产品）。</span></h5><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/6b73d7ae404b98cdbee45a7cd4265c6f_500x500.png\" style=\"max-width:100%;\"><br></p><p style=\"text-align: center;\"><img src=\"http://buy.yn-pulse.com/uploads/aa7e2763bc63d1e182b2274dd7157024_500x500.png\" style=\"max-width:100%;\"><br></p><h5 style=\"text-align: left;\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">功效：软化角质层，改善皮肤粗糙，收缩毛孔，清除黑头，保湿。</span></h5><h5><u style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">用法</u></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><u></u>1. 将脸以温水洗净。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">2. 使用清洁面膜或去黑头的护肤品。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">3. 将适量的城野医生零毛孔化妆水倒在质感较好的化妆棉上（推荐尤妮佳化妆棉），进行二次清洁。</span></h5><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">4. 湿敷5至8分钟后，根据自己的需要选择使用乳液或精华。</span></h5><p></p></p>', 48, '磅', 'pound', '瓶', 'bottle', 0.31, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (410, '4902750659742', 'UHA Tasty Gummy Strawberry Flavor 40g', 'UHA 草莓味觉糖 40g', 1.32, '/uploads/味觉糖草莓1.jpg', 30, 1, 1, '草莓味觉糖', 123, '2018-08-16 04:12:26', '2018-10-06 00:59:54', 51, '<p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E5%91%B3%E8%A7%89%E7%B3%96%E8%8D%89%E8%8E%931.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E5%91%B3%E8%A7%89%E7%B3%96%E8%8D%89%E8%8E%9312.jpg\"></p><p></p></p>', '<p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">味觉糖的糖果每种都很有特色，这款超人气果汁软糖具有真实水果口感。</span></p><p></p><p></p><p></p><p></p><p></p><p></p><h5><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">软糖外层采用仿葡萄外皮的糖衣，100%高度浓缩果汁，好像在吃真的水果一样，冰在冰箱里更好吃。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">一颗入嘴，就像嘴巴里有一个水果的小宇宙！</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">吃下去果汁的香甜在口中弥漫，口感QQ弹弹，带来多层口感的享受。&nbsp;</span></p></h5><p><h5 style=\"text-align: left;\"><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">平常读书看剧时当零食吃, 常常不知不觉一包就吃完了！&nbsp;</span><img src=\"http://buy.yn-pulse.com/uploads/味觉糖草莓1.jpg\" style=\"color: rgb(119, 119, 119); font-family: &quot;Noto Sans&quot;, sans-serif; max-width: 100%;\"><br></h5><p><img src=\"http://buy.yn-pulse.com/uploads/味觉糖草莓12.jpg\" style=\"max-width:100%;\"><br></p><p></p></p>', 72, '磅', 'pound', '包', 'bale', 0.10, NULL, 450, NULL, NULL, NULL);
INSERT INTO `product` VALUES (411, '4562172410040', 'YAMAMASA-KOYAMAEN Matcha Eggroll 100g', '山政小山园 抹茶蛋卷 100g', 4.03, '/uploads/山政小山园抹茶卷.jpg', 0, 1, 1, '抹茶蛋卷', 125, '2018-08-16 05:04:21', '2018-09-29 01:18:37', 53, '<p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E5%B1%B1%E6%94%BF%E5%B0%8F%E5%B1%B1%E5%9B%AD%E6%8A%B9%E8%8C%B6%E5%8D%B7.jpg\"><br></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">电视节目“京都苏GOOD”到宇治亲访丸久小山园时，大赞京都宇治抹茶蛋卷「非试不可」。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">京都宇治市，乃举世知名盛产抹茶的地方。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">当中「宇治丸久小山园」更是具有300多年制造抹茶的历史名店，多次获得日本「全国茶品评会」的金赏。\n&nbsp;</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">使用宇治抹茶粉所制作的抹茶蛋卷，由专业职人手工将烤好的外皮抹上抹茶。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">酥脆外皮与内层浓郁绿茶的绝妙配合，让人赞不绝口。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">一包12条\n独立包装，食用方便。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/山政小山园抹茶卷.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p></p>', 40, '磅', 'pound', '包', 'bale', 0.21, NULL, 365, NULL, NULL, NULL);
INSERT INTO `product` VALUES (413, '4571157255743', 'ORIHIRO Jelly Kiwi Flavor 6pcs 120g', 'ORIHIRO 低卡高纤蒟蒻果冻 奇异果味 6枚入 120g', 1.10, '/uploads/orihiro蒟篛猕猴桃1.jpg', 30, 1, 1, '蒟蒻果冻', 123, '2018-08-16 06:59:38', '2018-09-20 01:15:26', 66, '<p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/orihiro%E8%92%9F%E7%AF%9B%E7%8C%95%E7%8C%B4%E6%A1%831.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/orihiro%E8%92%9F%E7%AF%9B%E7%8C%95%E7%8C%B4%E6%A1%8312.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><p><span style=\"font-family: 微软雅黑; font-size: small; font-weight: bold; color: rgb(0, 0, 0);\">健康低卡零食首选，同时满足口腹之欲。</span></p><p><span style=\"font-family: 微软雅黑; font-size: small; font-weight: bold; color: rgb(0, 0, 0);\">蒟蒻是天然植物，健康营养，含有丰富纤维素，但只有很少的热量，<br></span></p><p></p><p></p><p></p><p></p><p><span style=\"font-family: 微软雅黑; font-size: small; font-weight: bold; color: rgb(0, 0, 0);\">它能清除血管的脏东西，排泄出人体不吸收的物质，对身体极有益处。</span></p><p></p><p><span style=\"font-family: 微软雅黑; font-size: small; font-weight: bold; color: rgb(0, 0, 0);\">很有弹性的好味道特别保健品，果香怡人，美味可口。</span></p><p><span style=\"font-family: 微软雅黑; font-size: small; font-weight: bold; color: rgb(0, 0, 0);\">奇异果味道，调节肠胃状态！</span></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/orihiro蒟篛猕猴桃1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/orihiro蒟篛猕猴桃12.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p></p>', 24, '磅', 'pound', '包', 'bale', 0.30, NULL, 300, NULL, NULL, NULL);
