INSERT INTO `product` VALUES (415, '4901360327973', 'BOURBON Rilakkuma Butter Cookies 60pcs', 'BOURBON布尔本 轻松熊什锦奶油曲奇饼干 60枚入', 8.50, '/uploads/IMG_8105.jpg', 0, 1, 1, '奶油曲奇', 125, '2018-08-17 01:15:01', '2018-09-20 01:00:24', 124, '<p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/IMG_8105.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/IMG_8083.jpg\"></p><p></p></p>', '<p><p></p><p><span style=\"font-weight: bold;\"><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">BOURBON是日本最著名的饼干品牌，</span><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small;\">铁盒上印有Rilakkuma图案。</span></span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">不管是节日送礼或者送给自己心爱的男女朋友，都非常适合。</span></p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">品质上远胜于欧洲的传统西点，做工考究，精致。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">关键是！这一罐可以吃到五种口味！</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">咖啡奶油、巧克力奶油、白奶油、 香草、蛋黃奶油。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">一盒满足不同的味觉享受。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/IMG_8105.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/IMG_8083.jpg\" style=\"max-width:100%;\"><br></p><p></p></p>', 4, '磅', 'pound', '盒', 'box', 1.24, NULL, 450, NULL, NULL, NULL);
INSERT INTO `product` VALUES (416, '4903379020500', 'ROYCE Nama Chocolate Champagne Pierre Mignon 20pcs', 'ROYCE 生巧克力 香槟味 20粒入', 10.63, '/uploads/luanse.jpg', 0, 1, 1, 'ROYCE生巧克力', 123, '2018-08-17 01:48:29', '2018-09-20 00:59:58', 65, '<p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/luanse.jpg\"><br></p><p></p><p></p></p>', '<p><p></p><p></p><p><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">生巧克力这个概念源于日本，其中生巧克力原料含量必须占产品本身的60%以上，且新鲜奶油与水分皆占产品本身重量10%以上的巧克力才能称为生巧克力。&nbsp;</span></p><p></p><p><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">ROYCE的生巧克力水分含量高达17%，鲜奶油更是超过了24%，口感更为顺滑。</span></p><p><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">生巧克力裹在质地绵密细腻的可可粉当中，一口下去，口感宛如芝士蛋糕一半柔软，香醇浓郁的巧克力味道在齿腔中四下蔓延。&nbsp;</span></p><p><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">负责任的说没吃过后悔一辈子……</span></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/luanse.jpg\" style=\"max-width: 100%;\"><br></p><p></p><p></p></p>', 60, '磅', 'pound', '盒', 'box', 0.40, NULL, 20, NULL, NULL, NULL);
