INSERT INTO `product` VALUES (490, '4901696506899', 'ROSETTE Exfoliating Scrub For All Skin 120g', 'ROSETTE 果酸去角质凝胶 清爽型 120g', 3.30, '/uploads/rosette 去角质 蓝.jpg', 0, 1, 1, 'ROSETTE果酸去角质凝胶', 130, '2018-09-05 01:44:32', '2018-10-06 00:57:35', 95, '<p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/rosette%20%E5%8E%BB%E8%A7%92%E8%B4%A8%20%E8%93%9D.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/rosette%20%E5%8E%BB%E8%A7%92%E8%B4%A8%20%E8%93%9D%202.jpg\"></p><p></p><p></p><p></p><p></p><p></p></p>', '<p></p><p></p><p></p><p></p><p></p><p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">ROSETTE</span><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">果酸去角质凝胶彻可以底去除陈旧角质，摆脱暗沉无光。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">添加3种果酸，乳酸、苹果酸、柠檬酸。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">发挥果酸的作用，去除暗沉（陈旧角质）的按摩凝胶。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">软凝胶型，不会给肌肤增加负担。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">有效抚平粗糙皮肤使肌肤光滑，让妆容更贴服。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">萃取茶叶精华，滋养肌肤，清洁过后脸部仍感受百般滋润。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/rosette 去角质 蓝.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/rosette 去角质 蓝 2.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 0.32, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (491, '4901696536407', 'ROSETTE Exfoliating Scrub For Dry Skin 120g', 'ROSETTE 果酸去角质凝胶 滋润型 120g', 3.30, '/uploads/rosette 去角质 红 .jpg', 20, 1, 1, 'ROSETTE果酸去角质凝胶', 130, '2018-09-05 01:46:59', '2018-09-07 07:19:00', 95, '<p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/rosette%20%E5%8E%BB%E8%A7%92%E8%B4%A8%20%E7%BA%A2%20.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/rosette%20%E5%8E%BB%E8%A7%92%E8%B4%A8%20%E7%BA%A2%202.jpg\"></p><p></p><p></p><p></p><p></p><p></p></p>', '<p></p><p></p><p></p><p></p><p></p><p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">ROSETTE</span><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">果酸去角质凝胶可以彻底去除陈旧角质，摆脱暗沉无光。</span></p><p></p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">添加3种果酸，乳酸、苹果酸、柠檬酸。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">发挥果酸的作用，去除暗沉（陈旧角质）的按摩凝胶。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">软凝胶型，不会给肌肤增加负担。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">有效抚平粗糙皮肤使肌肤光滑，让妆容更贴服。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">提取豆乳发酵液，有效锁住肌肤水分的保湿成分，打造水润透亮肌肤。</span></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/rosette 去角质 红 .jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/rosette 去角质 红 2.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 0.32, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (492, '4955814149901', 'NARIS UP Fragrance UV Spray SPF50+ PA++++ 90g', 'Naris Up 娜丽丝 精华芳香防晒喷雾 SPF50+ PA++++ 90g', 13.04, '/uploads/娜丽丝防晒喷雾正面.jpg', 0, 1, 1, '娜丽丝 精华芳香防晒喷雾 SPF50+ PA++++ 90g', 127, '2018-09-05 02:01:18', '2018-09-08 02:40:36', 91, '<p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E5%A8%9C%E4%B8%BD%E4%B8%9D%E9%98%B2%E6%99%92%E5%96%B7%E9%9B%BE%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E5%A8%9C%E4%B8%BD%E4%B8%9D%E9%98%B2%E6%99%92%E5%96%B7%E9%9B%BE%E8%83%8C%E9%9D%A2.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">古力娜扎同款的娜丽丝防晒喷雾！</span></p></p><p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">防晒指数高，有利于阻挡阳光对肌肤造成的伤害。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">成分温和无刺激，无着色剂，10种美容保湿成分，防晒补水更护肤。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">清爽不油腻透明不花妆，细腻喷雾，温和舒适的皮肤触感，迅速成膜，肌肤清爽0负担。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/娜丽丝防晒喷雾正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/娜丽丝防晒喷雾背面.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p></p>', 20, '磅', 'pound', '瓶', 'bottle', 0.34, NULL, 1000, NULL, NULL, NULL);
