INSERT INTO `product` VALUES (494, '4968909061187', 'UYEKI Mite Repellent &amp;amp;amp;amp;amp;amp;amp; Allergen Sterilization Spray 250ml', 'UYEKI 防螨虫除菌喷雾剂 孕妇婴儿可用 250ml', 8.82, '/uploads/uyeki除螨虫喷雾正面.jpg', 0, 1, 1, 'UYEKI 防螨虫除菌喷雾剂 250ml', 137, '2018-09-05 02:16:14', '2018-09-18 00:59:38', 182, '<p><p></p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/uyeki%E9%99%A4%E8%9E%A8%E8%99%AB%E5%96%B7%E9%9B%BE%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/uyeki%E9%99%A4%E8%9E%A8%E8%99%AB%E5%96%B7%E9%9B%BE%E8%83%8C%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/uyeki%E9%99%A4%E8%9E%A8%E8%99%AB%E5%96%B7%E9%9B%BE%E4%BE%A7%E9%9D%A2.jpg\"></p><p></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p></p><p><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">深度除螨，尽享睡眠 。</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">除螨消虫减少尘螨过敏，孕妇婴儿放心使用。</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">根据螨虫的生态而开发的除螨喷剂从根本上消除所寄生的螨虫。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/uyeki除螨虫喷雾正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/uyeki除螨虫喷雾背面.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">使用时只需对棉被、床垫、衣柜、地毯沙发等进行喷洒即可。</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: small; font-weight: bold;\">天然无害，喷一次效果持续一个月。</span><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/uyeki除螨虫喷雾侧面.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p><p></p></p>', 24, '磅', 'pound', '瓶', 'bottle', 0.80, NULL, 1000, NULL, NULL, NULL);
