INSERT INTO `product` VALUES (496, '4571139244420', 'PILLBOX Block &amp; Block Triple3 Healthy Diet 60 tablets', 'PILLBOX Block &amp; Block 三倍升级糖质脂质分解酵母 60粒入', 15.28, '/uploads/pillbox block_block triple3纤体丸正面.jpg', 30, 1, 1, 'PILLBOX分解酵母', 136, '2018-09-05 02:25:06', '2018-09-06 02:53:40', 183, '<p><p></p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/pillbox%20block&amp;block%20triple3%E7%BA%A4%E4%BD%93%E4%B8%B8%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/pillbox%20block&amp;block%20triple3%E7%BA%A4%E4%BD%93%E4%B8%B8%E8%83%8C%E9%9D%A2.jpg\"></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">PILLBOX热控素3倍加强版，让你放心吃不胖！</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">主要成分有壳聚糖、白芸豆提取物、五层龙提取物三种植物元素组成。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">可以降低油脂、糖分、淀粉、碳水化合物、高卡路里的摄入，吸取食物中的油，促进脂肪燃烧，</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">特别是对内脏脂肪有较大的帮助。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/pillbox block&amp;block triple3纤体丸正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/pillbox block&amp;block triple3纤体丸背面.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p><p></p></p>', 20, '磅', 'pound', '袋', 'bag', 0.06, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (497, '4571139244314', 'PILLBOX Onaka Fat Burner Dietary Nutrition 60 tablets', 'PILLBOX Onaka 减小腹腰赘肉脂肪 膳食营养素 60粒入', 24.44, '/uploads/onaka正面.jpg', 40, 1, 1, 'Onaka减小腹腰赘肉脂肪', 136, '2018-09-05 02:36:55', '2018-09-06 02:38:46', 183, '<p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/onaka%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/onaka%E8%83%8C%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/onaka%E4%BE%A7%E9%9D%A2.jpg\"></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">Onaka是日本销售火爆的一款专门针对肚子上赘肉，促进内脏脂肪减少的健康营养素。</span></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">官方临床验证3个月腰腹大约减少了20cm，体重也会随之下降。是一款对腰腹部缩小的产品。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">专利成分： 葛花提取物 Puerarialobata(Willd.) 葛花是豆科植物甘葛藤 P.thomsonii Benth的花，葛花富含的异黄酮对腰腹部的皮下和内脏脂肪，有令人欣喜的作用。</span></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/onaka正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/onaka背面.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">抑制中性脂肪合成，促进分解白色脂肪细胞中的脂肪，辅助支持褐色脂肪细胞的功能，促进脂肪燃烧。</span><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/onaka侧面.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold; text-decoration-line: underline;\">用法</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">1. 一盒60粒，每天吃4粒。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">2. 建议饭后或是睡前吃。</span><br></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><br></span></p><p></p><p></p><p></p></p>', 40, '磅', 'pound', '盒', 'box', 0.11, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (498, '4580011760033', 'POPO LABO Rose White Veil Pack 120g', 'POPO LABO 玫瑰美白去角质面膜 120g', 27.71, '/uploads/popolabo美白gel正面.jpg', 0, 1, 1, 'POPO LABO面膜', 130, '2018-09-05 02:52:25', '2018-10-06 00:57:16', 184, '<p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/popolabo%E7%BE%8E%E7%99%BDgel%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/popolabo%E7%BE%8E%E7%99%BDgel%E8%83%8C%E9%9D%A2.jpg\"></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">POPO LABO 玫瑰美白去角质面膜有着淡雅的玫瑰花香，十分好闻。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">含有玫瑰精华和天然魔芋，配合细小美白按摩珠，打造透亮美肌。</span></p><p><img src=\"http://buy.yn-pulse.com/uploads/popolabo美白gel正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/popolabo美白gel背面.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">功效：清除角质，柔肤，保湿，促进脸部血液循环。</span></p><p><span style=\"text-decoration-line: underline; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">用法</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">1. 用温水清洁面部。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">2. 将面部擦干，将面膜均匀涂在脸上，双手手指轻柔的按摩，然后停留3分钟，再用清水洗掉。<span style=\"text-decoration-line: underline;\"><br></span></span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">3. 一周1-2次使用即可，角质层薄的人们可以不按摩，停留片刻再洗掉也能达到变白提亮的作用。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><br></span></p><p></p><p></p><p></p></p>', 5, '磅', 'pound', '袋', 'bag', 0.29, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (499, '4901616011021', 'SUNSTAR Ora2 Stain Clear Toothpaste Floral White Tea Flavor 130g', 'SUNSTAR Ora2皓乐齿 亮白净色牙膏 白茶花味 125g', 2.90, '/uploads/ora2me牙膏原味增白正面.jpg', 150, 1, 1, 'Ora2皓乐齿', 126, '2018-09-05 02:58:43', '2018-09-20 01:15:56', 128, '<p><p></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/ora2me%E7%89%99%E8%86%8F%E5%8E%9F%E5%91%B3%E5%A2%9E%E7%99%BD%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/ora2me%E7%89%99%E8%86%8F%E5%8E%9F%E5%91%B3%E5%A2%9E%E7%99%BD%E8%83%8C%E9%9D%A2.jpg\"></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p><span style=\"font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: small; font-weight: bold;\">Ora2皓乐齿亮白净色牙膏拯救早上不想刷牙的你！<br></span></p><p><span style=\"font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: small; font-weight: bold;\">去除牙渍美化牙齿，可去除因茶、咖啡、抽烟等造成的牙渍，</span></p><p><span style=\"font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: small; font-weight: bold;\">恢复牙齿原本亮白颜色，使你拥有一口健康亮丽的牙齿。</span></p><p><span style=\"font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: small; font-weight: bold;\">独特的牙渍控制配方，让牙渍更难附着在牙齿表面，常保牙齿洁白亮丽。</span></p><p><span style=\"font-family: 微软雅黑; color: rgb(0, 0, 0); font-size: small; font-weight: bold;\">独特清新白茶花味道，完全没有传统牙膏刺激口腔的感觉。</span></p><p><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/ora2me牙膏原味增白正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/ora2me牙膏原味增白背面.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p><p></p></p>', 48, '磅', 'pound', '只', 'piece', 0.31, NULL, 1000, NULL, NULL, NULL);
