INSERT INTO `product` VALUES (501, '4901777283107', 'SUNTORY Gokuri Peach Juice Limited Edition 400ml', 'SUNTORY 三得利 Gokuri 水蜜桃果汁 季节限定 400ml', 1.84, '/uploads/三得利Gokuri桃子饮料正面.jpg', 0, 1, 1, '水蜜桃果汁', 118, '2018-09-05 04:20:29', '2018-09-20 00:51:49', 186, '<p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E4%B8%89%E5%BE%97%E5%88%A9Gokuri%E6%A1%83%E5%AD%90%E9%A5%AE%E6%96%99%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E4%B8%89%E5%BE%97%E5%88%A9Gokuri%E6%A1%83%E5%AD%90%E9%A5%AE%E6%96%99%E8%83%8C%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E4%B8%89%E5%BE%97%E5%88%A9Gokuri%E6%A1%83%E5%AD%90%E9%A5%AE%E6%96%99%E7%BB%86%E8%8A%82.jpg\"></p><p></p></p>', '<p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">三得利桃子汁清新澄澈，鲜美蜜桃味，口口蜜意。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">鲜活的桃子汁以无菌工艺，经过多道安全工序，巧妙的保留了水果的新鲜风味、质感和营养成分。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">酸爽柔和，清新可口，亲人肺腑，口味特别。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">浓郁的水蜜桃香气就如同吃了新鲜的水蜜桃，一口下去还能感受到扎实的果实纤维。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">一经推出立马成为2018拍照打卡IG分享必备之一。</span></p><p><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/三得利Gokuri桃子饮料正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/三得利Gokuri桃子饮料背面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/三得利Gokuri桃子饮料细节.jpg\" style=\"max-width:100%;\"><br></p><p></p></p>', 24, '磅', 'pound', '瓶', 'bottle', 0.94, NULL, 180, NULL, NULL, NULL);
INSERT INTO `product` VALUES (502, '655222758170', 'SnackTalk Cow Milk Tablet 20g', 'Snack Talk 零食物语 香浓高钙 卡通咀嚼牛奶片 20g', 0.50, '/uploads/零食物语 牛奶片.jpg', 10000, 1, 1, 'Snack Talk 零食物语 香浓高钙 卡通咀嚼牛奶片 20g', 123, '2018-09-05 04:27:24', '2018-09-05 07:36:35', 137, '<p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E9%9B%B6%E9%A3%9F%E7%89%A9%E8%AF%AD%20%E7%89%9B%E5%A5%B6%E7%89%87.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E9%9B%B6%E9%A3%9F%E7%89%A9%E8%AF%AD%20%E7%89%9B%E5%A5%B6%E7%89%87%202.jpg\"></p><p></p></p>', '<p><p></p><p></p><p>可以当零食，补钙、补充维生素的 Snack Talk 牛奶片，<br></p></p><p>采用100%纯正澳洲牛奶制成，无人造色素或防腐剂，能够促进儿童眼部健康。</p><p>适合1岁以上的儿童、孕妇及成人。1岁以上儿童建议每天2-3片，孕妇及成人建议每天3-5片。</p><p><p></p></p><p>含丰富的蛋白质、氨基酸、维生素，可补充营养、坚固骨骼！</p><p><p><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/零食物语 牛奶片.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/零食物语 牛奶片 2.jpg\" style=\"max-width:100%;\"><br></p><p></p></p>', 150, '磅', 'pound', '包', 'bale', 0.04, NULL, 730, NULL, NULL, NULL);
INSERT INTO `product` VALUES (503, '655222758187', 'SnackTalk Goat Milk Tablet 20g', 'Snack Talk 零食物语 香浓高钙 卡通咀嚼山羊奶片 20g', 0.44, '/uploads/snack talk羊奶片正面.jpg', 10000, 1, 1, '羊奶片', 123, '2018-09-05 04:29:08', '2018-09-05 07:36:06', 137, '<p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/snack%20talk%E7%BE%8A%E5%A5%B6%E7%89%87%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/snack%20talk%E7%BE%8A%E5%A5%B6%E7%89%87%E8%83%8C%E9%9D%A2.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><p>可以当零食，补钙、补充维生素的 Snack Talk 山羊奶片，<br></p><p>采用100%纯正澳洲山羊奶制成，无人造色素或防腐剂，能够促进儿童眼部健康。</p><p>适合1岁以上的儿童、孕妇及成人。1岁以上儿童建议每天2-3片，孕妇及成人建议每天3-5片。</p></p><p><p>山羊奶与母乳成分最接近，营养价值是牛奶的两倍，更易于人体吸收！</p><p>含丰富的蛋白质、氨基酸、维生素，可补充营养、坚固骨骼！<br></p><p><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/snack talk羊奶片正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/snack talk羊奶片背面.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p></p>', 150, '磅', 'pound', '包', 'bale', 0.04, NULL, 730, NULL, NULL, NULL);
