INSERT INTO `product` VALUES (530, '4987035541219', 'Otsuka The Wise Man\'s Powdered Fiber Diet  6g*30pcs', '大塚制药 贤者の食卓 酵素 抑制糖和脂肪 6克*30包', 14.37, '/uploads/贤者食卓正面.jpg', 40, 1, 1, '酵素', 136, '2018-09-06 00:35:19', '2018-09-20 04:06:02', 188, '<p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E8%B4%A4%E8%80%85%E9%A3%9F%E5%8D%93%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E8%B4%A4%E8%80%85%E9%A3%9F%E5%8D%93%E8%83%8C%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E8%B4%A4%E8%80%85%E9%A3%9F%E5%8D%93%E4%BE%A7%E9%9D%A2.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">贤者の食卓酵素是由大塚制药研发出来的特定保健品，可以减缓糖分吸收、降低血糖值、促进肠胃蠕动。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">原料中的“难消化糊精”是以玉米为原料提炼出的水溶性食物纤维，用餐的同时配合饮用难消化糊精可以有效减缓小肠中糖分和脂肪的吸收速度，从而有效抑制饭后血糖和血脂上升。<br></span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">在汤和冰水中也可以很容易的融化，无嗅无味无色；简便的小袋装，即使外出聚餐也可随身携带。</span><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></p><p></p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/贤者食卓正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/贤者食卓背面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/贤者食卓侧面.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"text-decoration-line: underline; font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 1盒30包，一日1-3包。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 随餐服用；除了碳酸跟气泡饮料，可以溶解于任何饮料中服用。</span></p><p><br></p><p></p><p></p></p>', 10, '磅', 'pound', '盒', 'box', 0.56, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (531, '4901037334600', 'YOSHIMI Curry Stick 144g', 'YOSHIMI 咖喱仙贝条 144g', 7.30, '/uploads/札幌咖喱咖喱条正面.jpg', 16, 1, 1, '咖喱仙贝', 121, '2018-09-07 00:30:51', '2018-10-06 04:32:38', 79, '<p><p></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E6%9C%AD%E5%B9%8C%E5%92%96%E5%96%B1%E5%92%96%E5%96%B1%E6%9D%A1%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E6%9C%AD%E5%B9%8C%E5%92%96%E5%96%B1%E5%92%96%E5%96%B1%E6%9D%A1%E8%83%8C%E9%9D%A2.jpg\"><br></p><p><img src=\"http://buy.yn-pulse.com/uploads/%E6%9C%AD%E5%B9%8C%E5%92%96%E5%96%B1%E5%92%96%E5%96%B1%E6%9D%A1%E4%BE%A7%E9%9D%A2.jpg\"></p><p></p></p>', '<p><p></p><p><pbox-sizing: border-box;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" font-family:=\"\" &quot;helvetica=\"\" neue&quot;,=\"\" arial,=\"\" &quot;pingfang=\"\" sc&quot;,=\"\" &quot;microsoft=\"\" yahei&quot;,=\"\" &quot;wenquanyi=\"\" micro=\"\" hei&quot;,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" start;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-style:=\"\" initial;=\"\" text-decoration-color:=\"\" initial;\"=\"\">作为日本人气爆棚🔥的小零食，完全再现了札幌小吃街的特产“烤玉米”的原始风味👏</pbox-sizing:></p><p><pbox-sizing: border-box;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" font-family:=\"\" &quot;helvetica=\"\" neue&quot;,=\"\" arial,=\"\" &quot;pingfang=\"\" sc&quot;,=\"\" &quot;microsoft=\"\" yahei&quot;,=\"\" &quot;wenquanyi=\"\" micro=\"\" hei&quot;,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" start;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-style:=\"\" initial;=\"\" text-decoration-color:=\"\" initial;\"=\"\">北海道因其独特的气候环境，当地的玉米既甜又软糯，这款玉米烧鲜贝在当地非常受欢迎💓去北海道除了要买白色恋人和薯条三兄弟，这个玉米烧鲜贝也不能漏了🙋吃起来很酥脆，口感相当好。</pbox-sizing:></p><p></p><p><pbox-sizing: border-box;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" font-family:=\"\" &quot;helvetica=\"\" neue&quot;,=\"\" arial,=\"\" &quot;pingfang=\"\" sc&quot;,=\"\" &quot;microsoft=\"\" yahei&quot;,=\"\" &quot;wenquanyi=\"\" micro=\"\" hei&quot;,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" start;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-style:=\"\" initial;=\"\" text-decoration-color:=\"\" initial;\"=\"\"><pbox-sizing: border-box;=\"\" color:=\"\" rgb(51,=\"\" 51,=\"\" 51);=\"\" font-family:=\"\" &quot;helvetica=\"\" neue&quot;,=\"\" arial,=\"\" &quot;pingfang=\"\" sc&quot;,=\"\" &quot;microsoft=\"\" yahei&quot;,=\"\" &quot;wenquanyi=\"\" micro=\"\" hei&quot;,=\"\" sans-serif;=\"\" font-size:=\"\" 14px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" start;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);=\"\" text-decoration-style:=\"\" initial;=\"\" text-decoration-color:=\"\" initial;\"=\"\">札幌烤玉米的特点在于是玉米🌽香气与焦香的酱油味完美融合。而这款YOSHIMI 札幌烤玉米煎果