INSERT INTO `product` VALUES (545, '4547691734242', 'Rilakkuma X OKAMOTO Condoms 10pcs', 'Rilakkuma X OKAMOTO冈本 轻松熊合作款 安全套 10枚入', 4.40, '/uploads/小熊.jpg', 100, 1, 1, '冈本轻松熊合作款安全套', 113, '2018-09-11 08:09:46', '2018-09-11 08:59:51', 29, '<p><p><img src=\"https://12buy.com/uploads/%E5%B0%8F%E7%86%8A.jpg\"><br></p><p><img src=\"https://12buy.com/uploads/%E5%B0%8F%E7%86%8A1.jpg\"><br></p><p><img src=\"https://12buy.com/uploads/%E5%B0%8F%E7%86%8A2.jpg\"></p></p>', '<p><p><img src=\"https://12buy.com/uploads/小熊.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/小熊1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/小熊2.jpg\" style=\"max-width:100%;\"><br></p></p>', 12, '磅', 'pound', '盒', 'box', 0.08, NULL, 1800, NULL, NULL, NULL);
INSERT INTO `product` VALUES (546, '4974234619245', 'Sagami Happiness 0.01 Condoms 5pcs', 'Sagami相模 幸福的0.01 安全套 5枚入', 7.23, '/uploads/相模001正面09212018.jpg', 100, 1, 1, '相模幸福的0.01安全套', 113, '2018-09-11 08:25:15', '2018-09-26 00:13:20', 192, '<p><p></p><p></p><p><img src=\"https://12buy.com/uploads/相模001正面09212018.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/相模001背面09212018.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/相模001侧面09212018.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p></p>', '<p><p></p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">性福的0.01mm 几近无佩戴感，让彼此更近一点</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">薄如蝉翼似有若无，与普通橡胶避孕套不同，该款产品采用与生物体兼容性高的聚氨酯材料制作而成，实现了0.01mm的厚度，而且没有橡胶避孕套（标准厚度为18毫米）特有的异味。优异的热传导功能，能够瞬间感受到皮肤的温度。表面光滑，使用时如接触般自然。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">推荐对天然橡胶过敏的人使用。</span></p><p><img src=\"https://12buy.com/uploads/相模001正面09212018.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/相模001背面09212018.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/相模001侧面09212018.jpg\" style=\"max-width:100%;\"><br></p><p></p><p></p></p>', 12, '磅', 'pound', '盒', 'box', 0.06, NULL, 1800, NULL, NULL, NULL);
INSERT INTO `product` VALUES (547, '4560264293724', 'SHINYAKOSO Night Diet Enzyme 30 packs', '新谷 夜晚吃多少都可以 瘦身酵素 经典版 30包入', 24.44, '/uploads/夜晚吃多少都可以酵素蓝色正面.jpg', 30, 1, 1, '瘦身酵素', 136, '2018-09-11 08:29:46', '2018-09-20 02:08:04', 165, '<p><p></p><p></p><p></p><p></p><p><img src=\"https://12buy.com/uploads/%E5%A4%9C%E6%99%9A%E5%90%83%E5%A4%9A%E5%B0%91%E9%83%BD%E5%8F%AF%E4%BB%A5%E9%85%B5%E7%B4%A0%E8%93%9D%E8%89%B2%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"https://12buy.com/uploads/%E5%A4%9C%E6%99%9A%E5%90%83%E5%A4%9A%E5%B0%91%E9%83%BD%E5%8F%AF%E4%BB%A5%E9%85%B5%E7%B4%A0%E8%93%9D%E8%89%B2%E8%83%8C%E9%9D%A2.jpg\"></p><p></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">新谷酵素有着吸引人的三大功效----抑制糖份吸收，燃烧过剩能量，调整易瘦体质。<br></span></p><p></p><p></p><p></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">要知道，晚饭吃得晚、夜宵、零食都是减肥的大敌，新谷酵素就是对抗这些最好的帮手。<br></span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">经典版加入了藤黄提取物和肉桂粉，可促进水分和脂肪的代谢。</span></p><p></p><p><img src=\"https://12buy.com/uploads/夜晚吃多少都可以酵素蓝色正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/夜晚吃多少都可以酵素蓝色背面.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">官方功效：可以分解米饭约10.4碗，蛋糕约6.6块，啤酒约68.7杯。</span></p><p></p><p><span style=\"text-decoration-line: underline; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">用法</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">1. 一盒30包，一包5粒。<br></span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">2. 一日1-3包（5-15粒）。</span></p><h5><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">3. 饭前/睡前30分钟冷水或温水吞服。</span></h5><div><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\"><br></span></div><p></p><p></p><p></p></p>', 20, '磅', 'pound', '盒', 'box', 0.22, NULL, 1000, NULL, NULL, NULL);
