INSERT INTO `product` VALUES (551, '4571212862367', 'Kyoto Snow White Sake Face Pack 170g', '京都白雪美肌 酒粕亮肤面膜 170g', 7.03, '/uploads/京都 酒粕.jpg', 96, 1, 1, '白雪美肌酒粕亮肤面膜', 130, '2018-09-11 08:56:49', '2018-09-19 01:55:18', 193, '<p><p></p><p></p><p><img src=\"https://12buy.com/uploads/%E4%BA%AC%E9%83%BD%20%E9%85%92%E7%B2%95.jpg\"><br></p><p><img src=\"https://12buy.com/uploads/%E4%BA%AC%E9%83%BD%20%E9%85%92%E7%B2%952.jpg\"></p><p></p><p></p></p>', '<p><p></p><p></p><p><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">京都白雪美肌酒粕面膜含有来自京都的纯天然酒粕和酵母。</span></p><p><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">淡淡的酒粕香，像加了牛奶的豆腐渣一样的细腻膏体，上脸非常温和。</span><br></p><p></p><p></p><p><img src=\"https://12buy.com/uploads/京都 酒粕.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/京都 酒粕2.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">功效：保湿，深层清洁，柔肤亮肤，收缩毛孔，细腻皮肤纹理。</span></p><p><span style=\"text-decoration-line: underline; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">用法</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">1. 用温水洁面。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">2. 涂抹于脸部.，敷10-15分钟左右。一周用2至3次即可。</span></p><p><span style=\"font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0); font-weight: bold;\">3. 用清水按摩清洗。</span></p><p><br></p><p></p><p></p></p>', 48, '磅', 'pound', '盒', 'box', 0.41, NULL, 1000, NULL, NULL, NULL);
INSERT INTO `product` VALUES (552, '4987072066447', 'KOBAYASHI Female Underwear Hygiene Wash 120ml', '小林制药 女性内衣洗衣液 去血渍 120ml', 3.04, '/uploads/经血洗涤剂正面.jpg', 0, 1, 1, '女性内衣洗衣液去血渍', 134, '2018-09-12 01:09:23', '2018-10-06 04:25:46', 41, '<p><p></p><p></p><p></p><p><img src=\"https://12buy.com/uploads/%E7%BB%8F%E8%A1%80%E6%B4%97%E6%B6%A4%E5%89%82%E6%AD%A3%E9%9D%A2.jpg\"><br></p><p><img src=\"https://12buy.com/uploads/%E7%BB%8F%E8%A1%80%E6%B4%97%E6%B6%A4%E5%89%82%E8%83%8C%E9%9D%A2.jpg\"></p><p></p><p></p><p></p></p>', '<p><p></p><p></p><p></p><p><span style=\"font-weight: bold;\">这款小林制药生理期内衣内裤洗涤剂可以说是专为女性解决生理期衣物清洗问题设计的了。</span></p><p><span style=\"font-weight: bold;\">该款为弱碱性，含有界面活性剂、烷基磺酸钠、安定化剂等，其中含有的渗透力特强的界面活性剂SAS，能彻底清理生理期时残留的血渍或月经白带所滞留的污渍。</span></p><p><span style=\"font-weight: bold;\">只需浸液20分钟左右便可彻底清除，无需大力擦洗，不会对衣物构成损坏，让你在每月那么几天也可以轻松舒心的清洗衣服，解决烦恼。</span></p><p></p><p></p><p><img src=\"https://12buy.com/uploads/经血洗涤剂正面.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/经血洗涤剂背面.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：除菌杀毒，清洁内衣物，去除血渍污渍。<br></span></p><p><span style=\"text-decoration-line: underline; font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">手洗-</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 清水或温水500ml加入10ml洗衣液 (瓶子侧面有标记，大概一个刻度，瓶子口朝下计量)</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 浸洗20分钟后清洗便可，如果太脏污﹐请将洗衣液直接沾在污渍部分﹐浸较长时间效果更佳<br></span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">机洗-</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">1. 按污渍多少﹐使用适量洗衣液</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">2. 把洗衣液直接涂在赃汚的地方后放置20分钟﹐搓洗后放入洗衣机，按照洗衣机操作清洗。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></p><p></p><p></p><p></p></p>', 48, '磅', 'pound', '瓶', 'bottle', 0.38, NULL, 1000, NULL, NULL, NULL);
