INSERT INTO `product` VALUES (565, '4903013492885-1', 'YAO KIN Cheese Flavored Fish Sausage 10 sticks', 'YAO KIN 芝士鱼肠 10根入', 1.94, '/uploads/YAO KIN 芝士鱼条.jpg', 30, 1, 1, '芝士鱼条', 121, '2018-09-12 02:28:02', '2018-10-06 02:45:22', 73, '<p><p></p><p style=\"text-align: center;\"><img src=\"https://12buy.com/uploads/YAO%20KIN%20%E8%8A%9D%E5%A3%AB%E9%B1%BC%E6%9D%A1.jpg\"><br></p><p></p></p>', '<p></p><p><p>YAO KIN 芝士鱼肠采用日本清晨4～6点的深海鲜鱼制作，每一根鱼肠内都配上了新鲜芝士，从而制成前所未有的鲜美鱼肉肠。</p><p>适合单吃，可以夹面包，做沙拉，放在面条里或炒菜均可。</p><p>肠内浓浓的芝士加热后味道更好！</p><p>肠里有少许黑色小点，包装上有说明，意思就是＂制品中存在的黑色物体是原料制作中鱼皮的成分，属正常现象。<br></p><p><br></p></p><p><p style=\"text-align: center;\"><img src=\"https://12buy.com/uploads/YAO KIN 芝士鱼条.jpg\" style=\"max-width:100%;\"><br></p><p></p></p>', 5, '磅', 'pound', '卷', 'roll', 0.04, NULL, 90, NULL, NULL, NULL);
INSERT INTO `product` VALUES (566, '4931449410678', 'IPSA Creative Concealer EX SPF25 PA+++', 'IPSA 纯美无暇三色遮瑕膏 SPF25 PA+++', 38.50, '/uploads/ipsa concealer 1.jpg', 0, 1, 1, 'IPSA遮瑕', 129, '2018-09-12 02:39:03', '2018-10-06 00:55:47', 102, '<p><p></p><p><img src=\"https://12buy.com/uploads/ipsa%20concealer%201.jpg\"><br></p><p><img src=\"https://12buy.com/uploads/ipsa%20concealer%202.jpg\"></p><p></p></p>', '<p><p></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">IPSA纯美无暇三色遮瑕膏可混合三种颜色，从而调和出适合自己的肤色。</span></p><p><span style=\"font-weight: bold; font-size: small; font-family: 微软雅黑; color: rgb(0, 0, 0);\">无暇光感，膏体柔滑服帖，持久保湿，完美遮瑕。</span></p><p><img src=\"https://12buy.com/uploads/ipsa concealer 1.jpg\" style=\"max-width:100%;\"><br></p><p><img src=\"https://12buy.com/uploads/ipsa concealer 2.jpg\" style=\"max-width:100%;\"><br></p><p><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">功效：遮盖黑眼圈、色斑、雀斑、痘印，均衡肤色，修饰问题肤。</span></p><p><span style=\"text-decoration-line: underline; font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">用法</span></p><p><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\">在斑点色素沉淀处用最上面的深色覆盖，接着用刷子取三种色，根据自己的肤色调节，在盒子的最下面的小槽内调匀颜色。</span><span style=\"text-decoration-line: underline;\"><br></span></p><p><span style=\"font-size: small; font-weight: bold; font-family: 微软雅黑; color: rgb(0, 0, 0);\"><br></span></p><p></p></p>', 10, '磅', 'pound', '只', 'piece', 0.10, NULL, 1000, NULL, NULL, NULL);
